-- ----------------------------
-- Table structure for cst_activity
-- ----------------------------
DROP TABLE IF EXISTS `cst_activity`;
CREATE TABLE `cst_activity` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `area_id` int(10) unsigned DEFAULT '0' COMMENT '区域ID',
  `title` varchar(500) DEFAULT '' COMMENT '活动名称',
  `brief` varchar(1000) DEFAULT '' COMMENT '简介',
  `category` int(10) unsigned DEFAULT '0' COMMENT '活动栏目分类',
  `content` text COMMENT '内容',
  `images` varchar(1000) DEFAULT '' COMMENT '图片',
  `servicetime` float(10,2) unsigned DEFAULT '0.00' COMMENT '服务时长',
  `phone` varchar(80) DEFAULT '' COMMENT '联系电话',
  `address` varchar(500) DEFAULT '' COMMENT '活动地址',
  `contacter` varchar(200) DEFAULT '' COMMENT '联系人',
  `group_name` varchar(200) DEFAULT '' COMMENT '发起支部（承办方）',
  `status` tinyint(1) unsigned DEFAULT '0' COMMENT '0未开始，1进行中，2已结束',
  `mid` varchar(200) DEFAULT '' COMMENT '现场签到审核人员',
  `is_publish` tinyint(1) unsigned DEFAULT '0' COMMENT '是否发布 1发布，0未发布',
  `publish_time` bigint(10) unsigned DEFAULT '0' COMMENT '发布时间',
  `start_time` bigint(10) unsigned DEFAULT '0' COMMENT '开始时间',
  `end_time` bigint(10) unsigned DEFAULT '0' COMMENT '结束时间',
  `add_time` bigint(10) unsigned DEFAULT '0' COMMENT '添加时间',
  `admin_id` int(10) unsigned DEFAULT '0' COMMENT '添加者ID',
  `add_name` varchar(100) DEFAULT '' COMMENT '发起人',
  `person_limit` smallint(6) unsigned DEFAULT '0' COMMENT '0 无限制(人数限制）',
  `event_code` varchar(50) DEFAULT '' COMMENT '奖励规则ID',
  `is_need_vol` tinyint(1) unsigned DEFAULT '0' COMMENT '是否需要志愿者',
  `vol_num` smallint(6) unsigned DEFAULT '0' COMMENT '志愿者人数',
  `photos` varchar(1000) DEFAULT '' COMMENT '图集',
  `is_notify` tinyint(1) unsigned DEFAULT '0' COMMENT '是否已通知',
  `newsids` varchar(500) DEFAULT '' COMMENT '关联新闻的ID',
  `click_count` int(10) unsigned DEFAULT '0' COMMENT '点击数',
  `likes` int(10) unsigned DEFAULT '0' COMMENT '点赞数',
  `is_report` tinyint(1) unsigned DEFAULT '0' COMMENT '0未上报，1已上报',
  `is_check` tinyint(1) unsigned DEFAULT '0' COMMENT '是否审核通过',
  `check_case` varchar(200) DEFAULT '' COMMENT '不通过原因',
  `check_time` bigint(10) unsigned DEFAULT '0' COMMENT '0 未审，1通过，2不通过',
  `check_user` varchar(200) DEFAULT '' COMMENT '审核人',
  `joincount` int(10) unsigned DEFAULT '0' COMMENT '参与人数',
  `uid` int(10) unsigned DEFAULT '0' COMMENT '团体负责人ID',
  `group_id` int(10) unsigned DEFAULT '0' COMMENT '团体ID',
  `x` varchar(20) DEFAULT '',
  `y` varchar(20) DEFAULT '',
  `is_volunteer` tinyint(1) unsigned DEFAULT '0' COMMENT '是否是志愿者活动',
  `is_menu` tinyint(1) unsigned DEFAULT '0' COMMENT '是否是点单活动',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=242 DEFAULT CHARSET=utf8 COMMENT='活动 - 主体表（志愿者活动）';

-- ----------------------------
-- Records of cst_activity
-- ----------------------------

