CREATE TABLE `cst_activity_bm_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `aid` int(10) unsigned DEFAULT '0' COMMENT '活动ID',
  `uid` int(10) unsigned DEFAULT '0' COMMENT '报名人',
  `addtime` bigint(10) unsigned DEFAULT '0' COMMENT '报名时间',
  `is_pass` tinyint(1) unsigned DEFAULT '0' COMMENT '是否通过。1通过',
  `is_sign` tinyint(1) unsigned DEFAULT '0' COMMENT '是否签到',
  `signtime` bigint(10) unsigned DEFAULT '0' COMMENT '签到时间',
  `name` varchar(200) DEFAULT '' COMMENT '姓名',
  `mobile` varchar(50) DEFAULT '' COMMENT '手机号',
  `tpe` tinyint(1) unsigned DEFAULT '1' COMMENT '1：报名，2：志愿者招募',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='活动 - 报名记录表';

