DROP TABLE IF EXISTS `cst_ad_info`;
CREATE TABLE `cst_ad_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ad_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '客户端广告记录编号',
  `ad_pos` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '广告位position',
  `area_id` int(6) unsigned NOT NULL DEFAULT '0' COMMENT '区域ID',
  `seq` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '广告名称',
  `description` varchar(100) NOT NULL DEFAULT '' COMMENT '摘要',
  `icon_url` varchar(512) NOT NULL DEFAULT '' COMMENT '图片地址',
  `image` varchar(512) NOT NULL DEFAULT '' COMMENT '图片相关',
  `url` varchar(1000) NOT NULL DEFAULT '' COMMENT '路由跳转地址',
  `is_ext` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否是外链，1是。0不是',
  `show_title` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '是否显示头部（0不显示；1显示）',
  `started_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '有效期 开始时间',
  `expired_in` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '有效期 结束时间',
  `status` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '状态 1上架; 0下架',
  `modified_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 COMMENT='广告 - 广告表';

