  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '名称',
  `area_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '地区ID',
  `position` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '应用位置',
  `style` tinyint(1) NOT NULL COMMENT '''样式 0多图轮播;1多图平铺滑动; 2单图平铺,3多图平铺;4跑马灯;5公告',
  `tpe` tinyint(1) NOT NULL COMMENT '0图; 1文; 2图文',
  `show_ct` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '单屏显示数量',
  `ext_json` varchar(1000) NOT NULL DEFAULT '' COMMENT '扩展字段',
  `comment` varchar(512) NOT NULL DEFAULT '' COMMENT '备注',
  `modified_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `position` (`area_id`,`position`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='广告 - 广告位表';

