-- ----------------------------
-- Table structure for cst_article
-- ----------------------------
DROP TABLE IF EXISTS `cst_article`;
CREATE TABLE `cst_article` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `title` varchar(200) DEFAULT '' COMMENT '标题',
  `brief` varchar(500) DEFAULT '' COMMENT '简介',
  `tpe` tinyint(1) unsigned DEFAULT '1' COMMENT '1文章，2图文，3图集，4视频，5推流，6专题',
  `img` varchar(300) DEFAULT '' COMMENT '封面图',
  `images` varchar(1000) DEFAULT NULL COMMENT '图集内容',
  `video_path` varchar(500) DEFAULT '' COMMENT '视频，推流地址',
  `video_id` bigint(20) unsigned DEFAULT '0' COMMENT '视频ID',
  `author` varchar(50) DEFAULT '' COMMENT '作者',
  `category` int(10) unsigned DEFAULT '0' COMMENT '分类ID',
  `area_id` int(10) unsigned DEFAULT '0' COMMENT '区域ID',
  `add_time` int(10) unsigned DEFAULT '0' COMMENT '添加时间',
  `click_count` int(10) unsigned DEFAULT '0' COMMENT '点击次数',
  `is_show` tinyint(1) unsigned DEFAULT '1' COMMENT '是否显示，1显示。0 不显示',
  `is_tv_show` tinyint(1) unsigned DEFAULT '0' COMMENT '是否TV显示',
  `is_wx_show` tinyint(1) unsigned DEFAULT '0' COMMENT '是否微信显示',
  `is_pc_show` tinyint(1) unsigned DEFAULT '0' COMMENT '是否PC显示',
  `is_show_index` tinyint(1) unsigned DEFAULT '0' COMMENT '首页显示',
  `is_publish` tinyint(1) unsigned DEFAULT '1' COMMENT '是否发布',
  `is_check` tinyint(1) unsigned DEFAULT '1' COMMENT '是否初审核通过，1通过，0未审，2不通过',
  `check_case` varchar(1000) DEFAULT '' COMMENT '未通过原因',
  `check_time` bigint(10) unsigned DEFAULT '0' COMMENT '审核时间',
  `check_user` int(10) unsigned DEFAULT '0' COMMENT '审核人ID',
  `is_final_check` tinyint(1) unsigned DEFAULT '1' COMMENT '是否终审，0未审核，1终审通过，2，终审不通过',
  `final_check_case` varchar(1000) DEFAULT '' COMMENT '终审不通过原因',
  `final_check_time` bigint(10) unsigned DEFAULT '0' COMMENT '终审时间',
  `final_check_user` int(10) unsigned DEFAULT '0' COMMENT '终审员ID',
  `admin_id` int(10) unsigned DEFAULT '0' COMMENT '添加人员ID',
  `publish_time` bigint(10) unsigned DEFAULT '0' COMMENT '发布时间',
  `likes` int(10) unsigned DEFAULT '0' COMMENT '点赞数',
  `is_del` tinyint(1) unsigned DEFAULT '0' COMMENT '是否删除',
  `article_model` varchar(20) DEFAULT '' COMMENT '文章模型',
  `uid` int(10) unsigned DEFAULT '0' COMMENT '用户ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=65 DEFAULT CHARSET=utf8 COMMENT='系统 - 文章表';

