  `keywords` varchar(255) NOT NULL DEFAULT '' COMMENT '关键字',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `diyname` varchar(30) NOT NULL DEFAULT '' COMMENT '自定义名称',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  `updatetime` int(10) DEFAULT NULL COMMENT '更新时间',
  `weight` int(10) NOT NULL DEFAULT '0' COMMENT '权重',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `counts` int(10) unsigned DEFAULT '0' COMMENT '文档数量',
  `area_id` int(10) unsigned DEFAULT '0' COMMENT '区域ID',
  `third_id` int(10) unsigned DEFAULT '0' COMMENT '第三方数据ID',
  `third_name` varchar(200) DEFAULT '' COMMENT '第三方名称',
  `model_type` varchar(50) DEFAULT '' COMMENT '文章模型',
  `menu_id` int(10) unsigned DEFAULT '0' COMMENT '菜单ID',
  PRIMARY KEY (`id`),
  KEY `weigh` (`weight`,`id`),
  KEY `pid` (`pid`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='分类表';

