  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `uid` int(10) unsigned DEFAULT '0' COMMENT '上报人ID',
  `title` varchar(300) DEFAULT '' COMMENT '标题',
  `username` varchar(100) DEFAULT '' COMMENT '上报人姓名',
  `mobile` varchar(20) DEFAULT '' COMMENT '联系方式 ',
  `img` varchar(1000) DEFAULT '' COMMENT '图片',
  `tpe` tinyint(2) unsigned DEFAULT '0' COMMENT '事件类型0随手拍，1，建言',
  `is_open` tinyint(1) unsigned DEFAULT '1' COMMENT '是否公开 0不公开，1公开',
  `is_deal` tinyint(1) unsigned DEFAULT '0' COMMENT '是否处理',
  `content` text COMMENT '上报内容',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上报时间',
  `dealtime` int(10) unsigned DEFAULT '0' COMMENT '处理时间',
