  `is_check` tinyint(1) unsigned DEFAULT '1' COMMENT '是否审核',
  `check_user` varchar(200) DEFAULT '' COMMENT '审核人',
  `check_time` int(10) unsigned DEFAULT '0' COMMENT '审核时间',
  `check_case` varchar(1000) DEFAULT '' COMMENT '审核原因',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='流程 - 事件主体表';

