-- ----------------------------
-- Table structure for cst_user_integral_log
-- ----------------------------
DROP TABLE IF EXISTS `cst_user_integral_log`;
CREATE TABLE `cst_user_integral_log` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '用户openid',
  `area_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '区域ID',
  `event_code` varchar(30) NOT NULL DEFAULT '' COMMENT '行为ID',
  `event_note` varchar(100) NOT NULL DEFAULT '' COMMENT '行为描述',
  `obj_id` varchar(64) NOT NULL DEFAULT '' COMMENT '第三方唯一标识',
  `scores` int(20) NOT NULL DEFAULT '0' COMMENT '积分数',
  `note` varchar(50) NOT NULL DEFAULT '' COMMENT '备注',
  `device_id` char(32) NOT NULL DEFAULT '' COMMENT '设备ID',
  `device_ip` char(15) NOT NULL DEFAULT '' COMMENT '设备IP',
  `create_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '加入时间',
  `can_edit` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否可更改',
  `grand_type` tinyint(1) unsigned DEFAULT '0' COMMENT '积分累计类型（0 行为积分 1 自定义积分）',
  PRIMARY KEY (`id`),
