  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '文件原名称',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '文件地址',
