  `third_id` int(10) unsigned DEFAULT '0' COMMENT '点播源ID',
  `third_source` varchar(100) DEFAULT '' COMMENT '第三方源',
  `duration` int(10) unsigned DEFAULT '0' COMMENT '时长，',
  `video_img` varchar(500) DEFAULT '' COMMENT '视频封面',
