-- ----------------------------
-- Table structure for cst_volunteer
-- ----------------------------
DROP TABLE IF EXISTS `cst_volunteer`;
CREATE TABLE `cst_volunteer` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(10) unsigned DEFAULT '0' COMMENT '用户ID',
  `name` varchar(50) DEFAULT '' COMMENT '名称',
  `brief` varchar(1000) DEFAULT '' COMMENT '简介',
  `join_time` bigint(10) unsigned DEFAULT '0' COMMENT '加入时间',
  `head_img` varchar(300) DEFAULT '' COMMENT '头象',
  `jobtime` bigint(10) unsigned DEFAULT '0' COMMENT '志愿时长，单位（秒）',
  `is_check` tinyint(1) unsigned DEFAULT '0' COMMENT '是否通过 ，0，未审，1通过，2不通过',
  `check_case` varchar(200) DEFAULT '' COMMENT '未通过原因',
  `check_admin_id` int(10) unsigned DEFAULT '0' COMMENT '审核员ID',
  `check_time` bigint(10) unsigned DEFAULT '0' COMMENT '审核时间',
  `area_id` int(10) unsigned DEFAULT '0' COMMENT '区域ID',
  `card` varchar(20) DEFAULT '' COMMENT '身份证',
  `mobile` varchar(30) DEFAULT '' COMMENT '手机号',
  `skill` varchar(300) DEFAULT '' COMMENT '技能',
  `scores` int(10) unsigned DEFAULT '0' COMMENT '志愿者积分',
  `work` varchar(500) DEFAULT '' COMMENT '工作单位',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20044 DEFAULT CHARSET=utf8 COMMENT='系统 - 志愿者表';

