CREATE TABLE `cst_volunteer_group` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `uid` int(10) unsigned DEFAULT '0' COMMENT '申请人ID',
  `title` varchar(200) NOT NULL COMMENT '党组织名称',
  `x` varchar(60) NOT NULL DEFAULT '' COMMENT '地理X',
  `y` varchar(60) NOT NULL DEFAULT '' COMMENT '地理Y',
  `condition` text COMMENT '团队要求',
  `content` text NOT NULL COMMENT '团队口号',
  `logo` varchar(500) NOT NULL DEFAULT '' COMMENT '组织LOGO',
  `address` varchar(500) NOT NULL DEFAULT '',
  `area_id` smallint(6) unsigned DEFAULT '0',
  `display` int(10) unsigned DEFAULT '0' COMMENT '排序',
  `addtime` bigint(10) unsigned DEFAULT '0' COMMENT '添加时间',
  `master` varchar(100) DEFAULT '' COMMENT '负责人名称',
  `mobile` varchar(50) DEFAULT '' COMMENT '联系电话',
  `is_check` tinyint(1) unsigned DEFAULT '0' COMMENT '是否通过0未审核，1通过，2不通过',
  `check_case` varchar(500) DEFAULT NULL,
  `check_time` int(10) unsigned DEFAULT '0' COMMENT '审核时间',
  `check_admin` int(10) unsigned DEFAULT '0' COMMENT '审核人ID',
  `work_unit` varchar(500) DEFAULT '' COMMENT '组织单位',
