  `scores` bigint(20) NOT NULL DEFAULT '0' COMMENT '积分数',
  UNIQUE KEY `fid` (`vid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='志愿者 - 志愿者积分表';

