-- ----------------------------
-- Table structure for cst_volunteer_integral_rules
-- ----------------------------
DROP TABLE IF EXISTS `cst_volunteer_integral_rules`;
CREATE TABLE `cst_volunteer_integral_rules` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `area_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '应用ID',
  `event_code` varchar(30) NOT NULL DEFAULT '' COMMENT '行为编号',
  `event_note` varchar(100) NOT NULL DEFAULT '' COMMENT '行为描述',
  `openid_limit` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '每用户计分次数 0为不限',
  `day_limit` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否按天计数',
  `grand_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '积分累计类型（0 行为积分 1 自定义积分）',
  `credit_amount` int(10) NOT NULL DEFAULT '0' COMMENT '产生计分值',
  `is_publish` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否发布',
  `is_delete` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  `create_user` varchar(20) NOT NULL DEFAULT '' COMMENT '创建人',
  `create_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `modify_user` varchar(20) NOT NULL DEFAULT '' COMMENT '最后修改人',
  `modify_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `event_code` (`area_id`,`event_code`) USING BTREE,
  KEY `is_delete` (`is_delete`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='志愿者  - 志愿者积分规则';

