-- ----------------------------
-- Table structure for cst_vote
-- ----------------------------
DROP TABLE IF EXISTS `cst_vote`;
CREATE TABLE `cst_vote` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(100) DEFAULT '' COMMENT '投票的名称',
  `img` varchar(500) DEFAULT '' COMMENT '图片',
  `can_use_tickets` int(10) unsigned DEFAULT '0' COMMENT '每用户拥有的票数',
  `day_limit` smallint(6) unsigned DEFAULT '0' COMMENT '限制每天都可以投多少票，，0不限制',
  `options_limit` smallint(6) unsigned DEFAULT '0' COMMENT '选项限制最多可投票数，0为不限',
  `area_id` int(10) unsigned DEFAULT '0' COMMENT '区域ID',
  `brief` varchar(500) DEFAULT '' COMMENT '投票规则',
  `status` tinyint(1) unsigned DEFAULT '0' COMMENT '0未开始，1进行中，2投票结束',
  `start_time` bigint(10) unsigned DEFAULT '0' COMMENT '开始时间',
  `end_time` bigint(10) unsigned DEFAULT '0' COMMENT '结束时间',
  `is_check` tinyint(1) unsigned DEFAULT '0' COMMENT '0未审核，1通过，2不通过',
  `check_admin` int(10) unsigned DEFAULT '0' COMMENT '审核人ID',
  `check_case` varchar(300) DEFAULT '' COMMENT '未通过原因',
  `check_time` int(10) unsigned DEFAULT '0' COMMENT '审核时间',
  `joincount` int(10) unsigned DEFAULT '0' COMMENT '参与人数',
  `is_publish` tinyint(1) unsigned DEFAULT '0' COMMENT '就否发布',
  `add_time` int(10) unsigned DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='活动 - 投票';

-- ----------------------------
-- Records of cst_vote
