  `tid` int(10) unsigned DEFAULT '0' COMMENT '投票活动ID',
  `option_id` int(10) unsigned DEFAULT '0' COMMENT '所投项ID',
  `add_time` bigint(10) unsigned DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='活动 - 投票参与记录表';

