  `title` varchar(500) DEFAULT '' COMMENT '选项内容',
  `img` varchar(500) DEFAULT '' COMMENT '图片',
  `tickets` int(10) unsigned DEFAULT '0' COMMENT '所投的票数',
  `brief` varchar(500) DEFAULT '' COMMENT '简介',
