INSERT INTO `cst_activity` VALUES ('81', '0', '送文化进基层宣传十九大精神', '送文化进基层宣传十九大精神', '1', '<p>近日，市老年书画协会和司徒镇书法协会的书法爱好者和文艺志愿者将来到司徒镇屯甸村下邳马甲村宣传十九大精神。大家在展示自己作品的同时，还纷纷挥毫泼墨，将一幅幅书画赠给下邳马甲村文体活动中心，助力新农村精神文明建设。</p>', '/attaches/image/20190219/1c17fc199829b871f94a643d846c8c0a.jpg', '0.00', '18362033170', '司徒镇屯甸村下邳马甲村', '陆一洲', '', '2', '', '1', '1550571676', '1550658063', '1550917270', '1550572025', '1', 'admin', '20', '', '0', '0', null, '0', '', '16', '5', '0', '1', '', '1550573938', '1', '12', '0', '0', '', '', '0', '0');
