INSERT INTO `cst_activity` VALUES ('83', '0', '为高质量发展提供强大精神动力', '6月5日，我市下发了《关于开展解放思想大讨论活动的实施方案》，指引全市上下掀起解放思想大讨论活动的热潮，为在新的起点上推进全面深化改革，加快建设“强富美高”新丹阳，开启高质量发展新征程凝聚广泛思想共识、提供强大精神动力。', '2', '<p style=\"text-indent: 2em; text-align: left;\">为深入学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神，特别是习近平总书记对江苏工作的系列重要指示精神，更大力度推动江苏高质量发展走在全国前列，省委于日前部署了在全省广泛开展解放思想大讨论活动。根据省委、镇江市委部署要求，我市及时成立了由市委主要领导领衔的思想解放大讨论活动领导小组，通过中心组学习、市委常委会等形式及时全面地传达学习了相关会议精神，并对解放思想大讨论和推动高质量发展走在前列进行专题研究部署。&nbsp;</p><p style=\"text-indent: 2em; text-align: left;\">据了解，根据《方案》要求，大讨论活动将围绕“学习新思想，改革再出发，开放迈新步，发展高质量”这一主题展开，结合丹阳实际，突出问题导向，重点围绕思想理念、精神状态、发展路径、系统化推进等四个方面开展深入讨论。此次大讨论活动以党员干部为重点，面向全市广大干部群众，从5月开始到年底，分四个阶段进行。其中5月下旬至6月上旬为宣传发动阶段，通过动员部署、营造氛围、征集问题等打牢大讨论活动的思想基础和工作基础；6月上旬至7月底为学习讨论阶段，重点开展专题学习、专家把脉、对标找差、各界座谈、群众献策等活动，深入学习习近平总书记全面深化改革开放重要思想，对标找差、讨论献策，进一步解放思想，研究推动高质量发展的目标举措；8月上旬至12月上旬为实践转化阶段，通过形成一批理论成果、推出一批实践成果、形成一批制度成果等途径转化讨论成果，推动指导实践；12月中旬至年底为持续深化阶段。</p><p><br/></p>', '/attaches/image/20190219/9cc095089889884ac37ee6c38e764591.jpg', '0.00', '13775500592', '丹阳市', '陈云宪', '', '2', '', '1', '1550571915', '1550658303', '1550831109', '1550572275', '1', 'admin', '200', '', '0', '0', null, '0', '', '8', '4', '0', '1', '', '1550573921', '1', '142', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('84', '0', '丹阳市档案局开展“中国梦，我见证—— 人生梦想寄存档案馆”活动', '丹阳市档案局开展“中国梦，我见证—— 人生梦想寄存档案馆”活动', '2', '', '/attaches/image/20190219/d20eacbfa920f1e3e3130b8414e9033d.jpg', '0.00', '13775500592', '丹阳市档案局', '陈云宪', '', '2', '', '0', '1550572020', '1550658412', '1550917616', '1550572352', '1', 'admin', '300', '', '0', '0', null, '0', '', '9', '3', '0', '1', '', '1550573925', '1', '123', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('85', '0', '第四届“书香丹阳”阅读节暨丹阳市中华诗词大赛开幕', '第四届“书香丹阳”阅读节暨丹阳市中华诗词大赛开幕', '3', '<p style=\"text-indent: 2em; text-align: left;\">副市长贺云华在开幕式讲话中说，开展此次活动，旨在激发广大市民的阅读兴趣，倡导大家自觉读书、热爱读书，希望各镇（区、街道）、各单位通过多种形式，开展丰富多彩的读书活动，在全社会形成良好的读书风尚和文明素养，为建设文明丹阳、和谐丹阳提供强大的精神动力和智力支持<br/></p><p style=\"text-indent: 2em; text-align: left;\">简短的开幕式后，丹阳市中华诗词大赛首场比赛拉开了帷幕，当天参赛的8支队伍16位选手均是来自城区八所中学的学生们。经过必答题、抢答题、附加题三轮环节的激烈比拼，云阳学校（初中部）代表队拔得头筹，勇夺比赛的第一名，并获得决赛资格；三中代表队、八中代表队分获第二和第三名。初赛第二场为教育系统小学专场，将于5月3日举行，之后的比赛将以“周周赛”的形式展开，每周举办一场<br/></p><p style=\"text-indent: 2em; text-align: left;\">今年的阅读节除了诗词大赛这场重头戏外，全市还将组织开展读书宣讲、阅读讲座、美文诵读会、图书漂流置换、送书下乡、演讲比赛、阅读征文比赛、读书摄影大赛等一系列活动，给市民送上一场阅读文化的饕餮盛宴。</p><p><br/></p>', '/attaches/image/20190219/0f42186cb661d328b0a14a78509b084c.png', '0.00', '13951271107', '华南实验学院分区', '荆红', '', '2', '', '1', '1550572126', '1550658519', '1550917722', '1550572463', '1', 'admin', '200', '', '0', '0', null, '0', '', '6', '1', '0', '1', '', '1550573913', '1', '114', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('86', '0', '举办2019镇江全民才艺大比拼活动', '举办2019镇江全民才艺大比拼活动', '3', '<p style=\"text-indent: 2em; text-align: left;\">&nbsp;为深化迎接党的十九大宣传工作，发扬党的群众文艺工作的优良传统，充分尊重人民群众的主体地位和首创精神，激发人民创造活力、繁荣群众文艺，中共镇江市委宣传部、镇江市文化广电新闻出版局、镇江市文学艺术界联合会、镇江市互联网信息办公室、镇江市文化广电产业集团决定在全市举办2017镇江全民才艺大比拼活动。<br/>一、活动宗旨<br/>&nbsp; &nbsp; 以迎接宣传贯彻党的十九大为主线，以社会主义核心价值观为引领，以“民星总动员·百姓同欢乐”为主题，通过搭建百姓舞台、展示群文风采，培育积极健康、多姿多彩的文化形态，引导群众在参与中自我表现、自我教育、自我服务，不断提升广大人民群众的文化获得感和幸福感，为党的十九大胜利召开营造喜庆热烈、昂扬向上的文化氛围。<br/>二、组织机构<br/>&nbsp; &nbsp; 主办单位：中共镇江市委宣传部、镇江市文化广电新闻出版局、镇江市文学艺术界联合会、镇江市互联网信息办公室、镇江市文化广电产业集团<br/>&nbsp;&nbsp;&nbsp; 承办单位：镇江市文化馆、镇江市音乐家协会、镇江市舞蹈家协会、镇江市戏剧曲艺家协会<br/>&nbsp;&nbsp;&nbsp; 协办单位：镇江各辖市（区）委宣传部、文广新（体、旅）局、文联，镇江新区党工委宣传部，镇江高新区党群工作局<br/>三、活动时间<br/>2017年9月至11月<br/>四、活动安排<br/>&nbsp; &nbsp; （一）报名：10月10日前，参赛对象直接通过线上（网络）或线下（现场）两种方式进行报名。咨询电话：85911620、85911605。<br/>&nbsp; &nbsp; 1．网络报名：《报名表》发送至2130664408@qq.com（《报名表》请在“文化镇江云”平台下载）<br/>&nbsp; &nbsp; 2．现场报名：镇江市文化馆活动部（山门口街37号三楼，除节假日外的工作时间）<br/>&nbsp; &nbsp; （二）海选（初赛）：根据参赛对象意愿，按线上（网络）海选和线下（现场）海选两种方式进行初赛。<br/>&nbsp; &nbsp; 1．线上海选：10月10日前，参赛对象通过网络报送作品视频参加海选。<br/>&nbsp; &nbsp; 2．线下海选：10月中旬，在镇江市文化馆举行，根据报名情况确定具体时间、场次（原则上安排在周六、周日）。<br/>&nbsp; &nbsp; （三）复赛：10月下旬至11月上旬，在市区的社区文化广场举行，根据海选情况确定具体时间、场次（原则上安排在周六、周日）。<br/>&nbsp; &nbsp; （四）决赛暨颁奖：11月中下旬，在镇江影剧院举行，市民免费领票观看。<br/>五、参赛对象<br/>&nbsp; &nbsp; 群众文化工作者和业余文艺爱好者（具有镇江籍户口或取得镇江市居住证的公民），不分年龄均可报名参加。<br/>专业文艺院团演员（包括有《营业性演出许可证》的各类民营文艺院团演员）以及艺术专业院校在校师生（包括大中专院校所属的艺术学院、音乐学院、艺术系、艺术学科在校师生）不得参加。<br/>六、参赛要求<br/>&nbsp; &nbsp; （一）作品要求<br/>&nbsp; &nbsp; 1．体现社会主义核心价值观的要求，传承和弘扬中华优秀传统文化，体现民族精神和时代精神，聚焦中华民族伟大复兴中国梦。<br/>&nbsp; &nbsp; 2．讲述百姓故事，反映多彩生活；注重民族特色和镇江特色，具有浓郁的现代生活气息。<br/>&nbsp; &nbsp; 3．作品主题鲜明，生动质朴，表演技巧娴熟，表现手法创新，形式丰富多样，富有艺术表现力和感染力。<br/>&nbsp; &nbsp; 4．突出群众文艺特色，鼓励源自群众原创，尊重和遵循文艺规律，提倡小投入、小制作，有生活、接地气，有个性、有创意，小作品、大情怀，讴歌真善美，传递正能量，适合基层演出和交流推广。<br/>（二）比赛要求<br/>&nbsp; &nbsp; 按音乐、舞蹈、戏剧曲艺3个艺术门类（不分老年、成人、少儿组别）。<br/>&nbsp; &nbsp; 1．音乐类（声乐</p>', '/attaches/image/20190219/3149d61751e717c2140cc1c9233bb8fb.jpg', '0.00', '13951271107', '文化馆', '荆红13951271107', '', '2', '', '1', '1550572225', '1550658619', '1551349823', '1550572558', '1', 'admin', '500', '', '0', '0', null, '0', '', '12', '1', '0', '1', '', '1550573906', '1', '367', '0', '0', '', '', '0', '0');
