INSERT INTO `cst_activity` VALUES ('89', '0', '丹阳市篮球爱好者活动报名开始啦', '丹阳市篮球爱好者活动报名开始啦', '5', '<p>&nbsp;篮球赛主题：</p><p>1 超越极限，超越自我</p><p>2 团结拼搏，永创辉煌 　</p><p>3 青春无畏，逐梦扬威。</p><p>4 球球俱进，分分必得</p><p>5 不畏强暴，所向披靡&nbsp;</p><p>6 三分线外，手起足落</p><p>7 努力拼搏，永夺第一 　　&nbsp;</p><p>8 团结拼搏，勇敢争先</p><p><br/></p>', '/attaches/image/20190219/2de239bfdafeeab139db6a1cce5c074f.jpg', '0.00', '13506108038', '市体育馆', '贺媛华', '', '2', '', '1', '1550483494', '1550487082', '1551005487', '1550573853', '1', 'admin', '0', '', '0', '0', null, '0', '', '23', '4', '0', '1', '', '1550724127', '1', '302', '0', '0', '', '', '0', '0');
