INSERT INTO `cst_activity` VALUES ('92', '0', '“走进丹北”文化庙会', '延陵镇文化庙会', '0', '<p>各志愿服务队：</p><p>&nbsp; &nbsp; &nbsp; &nbsp;2019年1月12日，新时代文明实践中心在延陵镇举行了第一场文化庙会，取得了圆满成功。文艺表演、免费摄影、书写春联。。。等志愿服务活动吸引了大批老百姓来现场参加活动。</p><p><br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp; 2019年3月6日（星期三）第二场准备在丹北镇后巷飞达广场举行，如果有意向现场展示志愿服务项目或者提供现场志愿服务的团队，欢迎报名参加。</p><p><br/></p><p>报名方式：</p><p>1、填写《文化庙会“走进丹北”志愿服务项目申报表》</p><p><br/></p><p>2、将以上表格填好发后发送到邮箱615868245@qq.com&quot;将以上表格填好发后发送到邮箱615868245@qq.com</p><p><br/></p><p>3、联系人：王留荣，电话：13912825666。</p><p><br/></p><p>4、截止时间：2月24日下午3点</p><p><br/></p>', '/attaches/image/20190220/dbd2e5668f5185414d074b56bce993b5.jpg', '0.00', '13775500592', '丹北镇后巷飞达广场', '陈云宪', '', '2', '841', '1', '1550480885', '1550653662', '1550992075', '1550654421', '1', 'admin', '200', '', '0', '0', null, '0', '', '14', '2', '0', '1', '', '1550654428', '1', '90', '0', '0', '', '', '0', '0');
