INSERT INTO `cst_activity` VALUES ('97', '0', '楹联讲座进埤小', '', '3', '<p>&nbsp; &nbsp; &nbsp; 3月6日，2019丹阳市志愿服务暨“文化庙会”第2站“幸福丹北”将在丹北举行。为进一步巩固提升我市全国文明城市和中华诗词之乡创建成果，有效促进新时代文明建设，确保楹联文化的正确性和规范性，主办单位将走进中华诗教先进单位埤城中心小学，开展楹联普及讲座，并发起“啄木鸟”纠错行动。欢迎参与。<img src=\"/attaches/image/20190228/155131582989958.png\"/></p><p>时间：2019年3月6日（周三）14：30-16：50</p><p>地点：埤城中心小学阶梯教室</p><p>内容：《纳古涵今一副联——对联漫谈》</p><p>主讲：赵永东，丹阳市新时代文明实践中心办公室，丹阳日报社主任、丹阳市诗词楹联学会会长</p><p><br/></p>', '/attaches/image/20190228/4578b0df87676f6f685e468d5a5b2e88.png', '0.00', '13052936510', '埤城中心小学阶梯教室', '赵永东', '', '2', '', '1', '1551311867', '1551315442', '1551833852', '1551315936', '25', '周志平', '120', '', '0', '0', '', '0', '', '4', '5', '0', '1', '', '1551315955', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('98', '0', '观看2019年丹北镇文化庙会暨首届农民篮球联赛', '', '5', '<p>2019年丹北镇文化庙会暨首届农民篮球联赛</p><p>一、竞赛时间：2019年3月6日<br/></p><p>二：竞赛地点：飞达广场灯光球场、天工国际体育馆</p><p>三、竞赛办法：</p><p>1、各代表队可报领队1人、教练1人、运动员12人。</p><p>2、运动员资格必须是丹北镇身份证、丹北镇养老保险，原籍是丹北镇的人必须参加原老乡镇的任何一支队伍的篮球比赛，不准聘请外乡镇的运动员参加比赛，如发现不符合要求者取消比赛全部成绩，并追究领队责任。</p><p>四、录取名次和奖励</p><p>比赛录取前六名发给奖杯和奖金，其余发给优秀组织奖。</p><p>五、各队报名单于3月1日前送往丹北镇文体中心戎贺彪，一经报名，不得更改。报名单上运动员资格需经行政村、厂领导审核签字并加盖公章。</p><p>六、各参赛单位伙食费、车费自理。</p><p>七、未经事宜另行通知。</p><p>八、本规程解释权属篮球联赛组委会。</p><p>2019年丹北镇首届农民篮球联赛代表队名单<br/></p><p>一、	参赛单位：&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>1、丹北镇东方村代表队&nbsp; &nbsp;&nbsp;</p><p>2、丹北镇济德村代表队</p><p>3、丹北镇高桥村代表队</p><p>4、丹北镇中心居委会代表队</p><p>5、丹北镇前巷村代表队</p><p>6、丹北镇飞达村代表队</p><p>7、丹北镇后巷派出所代表队</p><p>8、丹北镇新华隆代表队</p><p><br/></p><p><br/></p>', '', '0.00', '13506108038', '飞达广场灯光球场、天工国际体育馆', '', '', '2', '', '1', '1551404724', '1551408175', '1551829390', '1551408561', '25', '周志平', '0', '', '0', '0', null, '0', '', '3', '3', '0', '1', '', '1551408643', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('101', '0', '《中国特色社会主义的新历史方位》讲座', '', '1', '<p><strong>主题：</strong>《中国特色社会主义的新历史方位》</p><p><strong>时间：</strong>3月6日 上午9点-10点</p><p><strong>地点：</strong>丹北镇飞达村委会三楼会议室</p><p><strong>主讲人</strong><strong>:&nbsp; </strong>虞伟&nbsp; 中共丹阳市委党校副校长，高级讲师，丹阳市委十九大精神宣讲团成员。</p><p><strong>内容概述：</strong></p><p>&nbsp; &nbsp; &nbsp; 党的十九大报告指出：经过长期努力，中国特色社会主义进入了新时代，这是我国发展新的历史方位。理论宣讲平台诚邀中共丹阳市委党校副校长，高级讲师虞伟围绕中国特色社会主义的新历史方位这一主题为广大农村党员授课，深入解析中国特色社会主义进入新时代的实践基础 、理论依据、深刻内涵和新时代中国共产党的历史使命。</p><p><strong>&nbsp;</strong></p><p><br/></p>', '', '0.00', '', '丹北镇飞达村委会三楼会议室', '15996830176', '', '2', '', '1', '1551654410', '1551665171', '1551830785', '1551665616', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '4', '0', '1', '', '1551665672', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('102', '0', '“文化庙会”第二站“幸福丹北”大型志愿服务活动', '', '0', '<p>3月6日上午8:00，丹北镇飞达广场“五大平台”志愿者为群众提供法律法规咨询、家电维修、生活照料、健康咨询等全方位志愿服务，另有多种科普书籍免费赠阅。</p>', '', '0.00', '13775500592', '丹北镇飞达广场', '', '', '2', '', '1', '1551675886', '1551678962', '1551866164', '1551679640', '25', '周志平', '0', '', '0', '0', null, '0', '', '0', '0', '0', '1', '', '1551680040', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('103', '0', '“踏歌新时代.文明丹阳行”之“幸福丹北”篇专场文艺演出', '', '3', '<p>时间：2019年3月6日下午14:00——15:30</p><p>地点：丹北镇飞达广场</p><p>主办：丹阳市新时代文明实践中心、中共丹阳市委宣传部、丹阳市文明办</p><p>承办：丹北镇新时代文明实践所、丹阳市文体广电和旅游局</p><p>活动内容概述：今年7月6日，习近平总书记主持召开中央全面深化改革委员会第三次会议，审议通过了《关于建设新时代文明实践中心试点工作的指导意见》，在全国2800多个县级行政区域中选定了12个省份的51个县作为首批试点，江苏省有8个县入选，我市是其中之一，这是党中央的信任，是一份光荣，更是一份责任。建设“新时代文明实践中心”是新时代文明建设工作的一件大事，通过积极探索实践，将使新时代文明实践中心成为传播好声音、弘扬主旋律、开创新业绩、凝聚干群心的主阵地，促进人居环境美、乡风民风美、文化生活美，培育农村文明风尚。</p><p><br/></p><p>活动流程及节目单：</p><p>一、暖场《九狮舞》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>丹北镇</p><p>主持人开场白</p><p>二、舞蹈《春到百合开》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>丹北镇</p><p>三、男声独唱《红旗飘飘》、《桃花朵朵开》&nbsp; &nbsp; &nbsp;&nbsp;</p><p>丹剧团</p><p>四、器乐合奏《山丹丹花开红艳艳》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>丹剧团</p><p>五、小品《好人老宫》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>丹剧团&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>六、太极表演《疏梅弄影》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>丹北镇</p><p>七、非遗展演—徒手剪字&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>&nbsp;丹北镇</p><p>八、腰鼓舞《鼓动天地》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>体育平台</p><p>九、古典舞《桃夭》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>丹剧团</p><p>十、太极表演《传统杨式四十二式太极拳》&nbsp; &nbsp; &nbsp;&nbsp;</p><p>体育平台</p><p>十一、女声独唱《我愿》、《前门情思大碗茶》&nbsp; &nbsp;&nbsp;</p><p>丹剧团</p><p>十二、舞蹈《花开盛世》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>丹剧团</p><p><br/></p>', '/attaches/image/20190304/e2f251c57d5212d49b474ef3c70c60c8.png', '0.00', '13951271107', '丹北镇飞达广场', '', '', '2', '', '1', '0', '1551685983', '1551851586', '1551686438', '25', '周志平', '0', '', '0', '0', null, '0', '', '0', '0', '0', '1', '', '1551686822', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('104', '0', '“踏歌新时代.文明丹阳行”之“幸福丹北”篇非遗展演', '', '3', '<p>“踏歌新时代.文明丹阳行”之“幸福丹北”篇非遗展演</p><p>时间：2019年3月6日下午14:00——15:30</p><p>地点：丹北镇飞达广场</p><p>主办：丹阳市新时代文明实践中心、中共丹阳市委宣传部、丹阳市文明办</p><p>承办：丹北镇新时代文明实践所、丹阳市文体广电和旅游局</p><p>活动内容概述：今年7月6日，习近平总书记主持召开中央全面深化改革委员会第三次会议，审议通过了《关于建设新时代文明实践中心试点工作的指导意见》，在全国2800多个县级行政区域中选定了12个省份的51个县作为首批试点，江苏省有8个县入选，我市是其中之一，这是党中央的信任，是一份光荣，更是一份责任。建设“新时代文明实践中心”是新时代文明建设工作的一件大事，通过积极探索实践，将使新时代文明实践中心成为传播好声音、弘扬主旋律、开创新业绩、凝聚干群心的主阵地，促进人居环境美、乡风民风美、文化生活美，培育农村文明风尚。</p><p><br/></p><p>非遗项目：</p><p>1、封缸酒酿造技艺</p><p>2、乱针绣</p><p>3、天鹅绒织造技艺</p><p>4、面塑</p><p>5、剪纸</p><p>6、烙铁画</p><p>7、泥塑</p><p>8、许氏二胡制作技艺</p><p>9、王氏经络推拿</p><p>10、嘉山灶马膏</p><p>11、毛笔制作技艺</p><p><br/></p>', '', '0.00', '13951271107', '丹北镇飞达广场', '', '', '2', '', '1', '1551686133', '1551686284', '1551859104', '1551686670', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1551686707', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('105', '0', '《高新技术企业申报》培训讲座', '', '4', '<p>《高新技术企业申报》培训讲座</p><p>旨在帮助企业正确理解、把握国家对高新技术企业申报政策的规定要求，使企业能够快速、准确掌握其申报要领，助力企业向高质量发展，贡献社会，带动老百姓致富。</p><p>主讲人：徐建芳</p><p>简历：毕业于西南交通大学，现就职于丹阳市科学技术局，从事科技创新服务、高新技术企业培育指导等相关工作。</p><p>时间：2019年3月6号&nbsp; &nbsp;14：30-16:30</p><p>地点：丹北镇人民政府501会议室</p><p><br/></p>', '', '0.00', '13861345321', '丹北镇人民政府501会议室', '', '', '1', '', '0', '1551686430', '1551686759', '1551852000', '1551687215', '25', '周志平', '0', '', '0', '0', '', '0', '', '1', '1', '0', '1', '', '1551687283', '25', '0', '0', '0', '', '', '0', '0');
