INSERT INTO `cst_activity` VALUES ('110', '0', '非物质文化遗产女传承人作品展', '非物质文化遗产女传承人作品现场演示展览', '0', '<p>&nbsp; &nbsp; 非物质文化遗产烙铁画传承人孙红芳、非物质文化遗产乱针绣传承人石丽君、非物质文化遗产天鹅绒织造技艺传承人戴玲、非物质文化遗产剪纸传承人郑静，现场演示+优秀作品展示</p>', '/attaches/image/20190304/bded0a354dc1c2fffe59bd790b28b8a3.jpg', '0.00', '86508511', '', '', '', '2', '', '1', '1551674748', '1551692739', '1551779143', '1551693287', '63', '丹阳市巾帼志愿服务队', '0', '', '0', '0', '', '0', '', '0', '2', '0', '1', '', '1551694913', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('111', '0', '吕城镇开展“学雷锋、献爱心”主题志愿活动', '吕城镇开展“学雷锋、献爱心”主题志愿活动', '0', '<p>“老吾老以及人之老”，为进一步弘扬雷锋精神，传承“尊老、敬老、爱老”中华民族传统美德，倡导“奉献、友爱、互助、进步”的志愿精神，吕城镇团委响应市团委号召，于日前，联合河北村志愿者走进康福养老院、残疾人之家开展“学雷锋、献爱心”主题志愿活动，用志愿活动让老人们感受社会的真情与温暖。</p><p>在康福敬老院里，志愿者们分若干小组开展特色志愿服务活动，志愿者们井然有序地帮老人们量血压、打扫卫生、剪指甲、整理头发、推行动不便的老人晒太阳、分发慰问品等，敬老院内外春意盎然。服务中，志愿者们对老人们身体状况、饮食起居等日常生活的关切让老人们分外感动，虽然老人们行动不便，言语不清，但他们流露出的笑容、紧握的双手和感动的泪水让志愿者们动容。吕城镇团委希望通过此次学雷锋志愿服务活动，让更多爱心人士加入到关爱老年人的行动中来，让爱在吕城这座小城中流淌。</p><p><img src=\"/attaches/image/20190305/155174939358022.jpg\"/><img src=\"/attaches/image/20190305/155174940060282.jpg\"/><img src=\"/attaches/image/20190305/155174941167568.jpg\"/><img src=\"/attaches/image/20190305/155174942924407.jpg\"/></p>', '/attaches/image/20190305/201525b2586c46a28a0cff241a32fd68.jpg', '0.00', '', '', '', '', '2', '', '1', '0', '1551659400', '1551670200', '1551749476', '40', '吕城镇', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1551755524', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('112', '0', '好人宣德馆文化服务活动', '为社会大众提供经典诵读、健身气功、喝茶、唱歌等活动的服务。', '0', '<p>为社会大众提供经典诵读、健身气功、喝茶、唱歌等活动的服务。每天都需要志愿者哟，欢迎大家积极报名哦~</p>', '/attaches/image/20190305/7797ec2d5387b7b9e21678c56a93769d.jpg', '0.00', '13236392705', '丹阳市人民公园好人宣德馆', '顾金燕', '', '1', '', '1', '1551750855', '1551837182', '1561946032', '1551752305', '68', '丹阳传统文化志愿服务队', '3', '', '0', '0', '', '0', '', '2', '12', '0', '1', '', '1551752921', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('113', '0', '好人宣德课后服务班招生活动', '解决孩子放学后无人看管的问题，督促孩子完成作业、学习传统礼仪。', '0', '<p>&nbsp; &nbsp; 为了积极响应教育部办公厅号召，解决中小学生放学后无人看管的社会难题，丹阳市中华传统文化学会分别开设了明德书屋、好人宣德馆、爱读书吧、书香学府四个公益课后服务班，督促孩子完成作业，学习优秀传统文化。开班以来受到社会的一直好评，现每班设置20名学生。目前，好人宣德馆还有3个名额可以接受报名，其余三个班已经报满。（课后服务班时间：15：30-17：30）</p>', '', '0.00', '13236392705', '丹阳市人民公园好人宣德馆', '顾金燕', '', '1', '', '0', '1551752512', '1551838887', '1559269291', '1551755107', '68', '丹阳传统文化志愿服务队', '20', '', '0', '0', null, '0', '', '2', '5', '0', '1', '', '1551755321', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('114', '0', '3.8“自我关爱”活动', '妇女节来临之际，心理志愿者进社区开展“自我关爱”讲座', '0', '<p>妇女节来临之际，我们心理学会的耿主任针对女性心理健康开展“自我关爱”讲座，若有意愿参与沟通服务的志愿者，请申请报名。</p>', '', '0.00', '15952929743', '开发区河阳三桥村委会', '李菊', '', '2', '', '1', '1551941354', '1552006843', '1552012257', '1551941771', '50', '丹阳市心理学会志愿服务队', '3', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1551956922', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('115', '0', '呵护女性健康 打造自信魅力', '为全面提高女性综合素质，进一步普及女性健康知识，促进女性心理健康，从容应对现代社会的各种竞争和压力，更好地应对生活。', '4', '<p>邀请丹阳华山医院院长，周亚华为广大女性宣传女性健康知识、介绍日常生活中的防护方法及注意事项，解答女性日常工作生活中的健康疑问</p>', '', '0.00', '13861345321', '云阳高新区C3楼一楼众创咖啡', '陆丽娟', '', '2', '', '1', '1551947896', '1552008607', '1552014047', '1551948427', '54', '科技科普志愿服务队', '10', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1551956900', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('116', '0', '共度美丽妇女节 同创文明新时代', '近日，为迎接“三八国际妇女节”，江南人家社区联合兄弟社区开展“共度美丽妇女节 同创文明新时代”——社区庆“三.八”系列活动。社区专门邀请了花艺师和厨艺师到现场进行教学指导。据悉，此次活动共吸引100余名妇女同胞参与，大家其乐融融地享受插花、制作披萨给大家带来的快乐。活动最后大家将自己制作的花篮和披萨送给了辖区有需要的居民。', '0', '<p><span style=\"font-size: 18px;\"> &nbsp; 近日，为迎接“三八国际妇女节”，江南人家社区联合兄弟社区开展“共度美丽妇女节 &nbsp;同创文明新时代”——社区庆“三.八”系列活动。社区专门邀请了花艺师和厨艺师到现场进行教学指导。据悉，此次活动共吸引100余名妇女同胞参与，大家其乐融融地享受插花、制作披萨给大家带来的快乐。活动最后大家将自己制作的花篮和披萨送给了辖区单亲妈妈、困难家庭，并为她们送上了节日的祝福。</span><br/></p>', '/attaches/image/20190307/10bfaf3d11adaf84597c523e40028ccc.JPG', '0.00', '0511-86586036', '江南人家会所一楼', '眭沛', '', '2', '', '1', '1551662100', '1551747600', '1551758400', '1551961921', '305', '江南人家社区', '100', '', '0', '0', '', '0', '', '0', '1', '0', '1', '', '1552444112', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('117', '0', '\"学习雷锋 保护环境”环保捡垃圾活动', '本月16日下午一点半将开展“学习雷锋 保护环境”环保捡垃圾活动，参与者有小天使，志愿者，家长，户外爱好者等，欢迎大家报名参与，让我们和孩子一起随手捡垃圾：，必须穿防滑的鞋子，16日下午一点在人民公园东停车场集中，目的地丹阳市体育公园（水晶山）', '0', '<p>&nbsp; &nbsp; &nbsp; 本月16日下午一点半将开展“学习雷锋 保护环境”环保捡垃圾活动，参与者有小天使，志愿者，家长，户外爱好者等，欢迎大家报名参与，让我们和孩子一起随手捡垃圾：，必须穿防滑的鞋子，16日下午一点在人民公园东停车场集中，目的地丹阳市体育公园（水晶山）、上湾水库，欢迎大家报名参与（小天使联系人）风雷13952953028，（户外联系人）风铃13626265390。</p><p><br/></p>', '/attaches/image/20190312/a9891a599257401bcfab02e8f38141be.jpg', '0.00', '13952953028', '丹阳市体育公园', '巢农', '', '2', '', '1', '0', '1552712400', '1552726800', '1552367504', '73', '爱在飘扬志愿服务队', '25', '', '0', '0', '', '0', '', '0', '3', '0', '1', '', '1552444102', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('118', '0', '正是三月好时光  古镇吕城植树忙', '正是三月好时光  古镇吕城植树忙', '0', '<p>人勤春来早，植绿正当时。为加快打造“河畅水清、岸绿景美、人水和谐”的生态新镇，在第41个全民义务植树节到来之际，吕城镇干部群众与驻地91079部队官兵联合开展义务植树活动。</p><p>向阳河岸边，春风轻拂。镇长高飞主持本次活动，镇党委书记崔晓俊宣布活动开幕，一百八十余名志愿者们奔赴各组植树点。</p><p>崔书记、高镇长和大家一起，按照技术指导员讲解的植树要领，拿起铁锹投入到植树活动中，挥锹铲土、踩实新土、堆起围堰、提桶浇水，大家互相配合，每个步骤都做得认真细致。</p><p>经过一番热火朝天的辛勤劳动，300余株栾树整齐地伫立在向阳河堤上。放眼望去，一排排生机盎然的树木迎风而立，为大地添绿增色。</p><p>通过本次活动，进一步牢固树立了生态理念，把造林绿化作为改善生态环境、建设生态新镇最直接、最有效、最经济的途径和手段，充分发挥森林的“吸尘器”、“净化器”和生态功能，为全镇广大人民群众创造一个生态、美丽、宜居的工作和生活环境，为吕城“一体两翼”高质量发展提供充沛的绿色能量。</p><p>近年来，我镇森林资源总量不断增加，自然生态和人居环境不断改善，发展的环境承载力得到明显提升。全镇林木覆盖率达19%，农田林网控制率达73%，通道绿化率达95%，西沟村、窑头村、谭家塘、大荆村先后被评为江苏省绿化示范村、江苏省“三化”示范村。2018年，新增成片造林700亩（含永丰河、向阳河、东战备河两侧），更新及完善农田林网控制面积2150亩，四旁植树5.5万株，全民义务植树4.5万株。实践证明，开展全民义务植树、推进林业生态建设，是一项顺民心、合民意，造福子孙后代的千秋工程。</p><p><img src=\"/attaches/image/20190312/155237054982767.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237054922898.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237055023471.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237055097283.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237055042893.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237055027580.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237055157330.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237055182759.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237055151680.jpg\"/></p><p><img src=\"/attaches/image/20190312/155237055153699.jpg\"/></p><p><br/></p>', '/attaches/image/20190312/150b4dd8b928ea38fce523dacceb8212.JPG', '0.00', '18013435366', '吕城镇', '曹苗苗', '', '2', '', '1', '0', '1552280400', '1552291200', '1552370592', '40', '吕城镇', '188', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1552444081', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('119', '0', '“点赞祖国  学习强国”——庆祝新中国成立70周年诵读分享会', '', '1', '<p><strong>&nbsp; &nbsp; &nbsp; &nbsp;内容：</strong>以“学习强国”学习平台中的内容为主，突出习近平新时代中国特色社会主义思想和党的十九大精神以及新中国成立70年来党领导全国各族人民取得的伟大成绩。</p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;方式：</strong>单独诵读、联合诵读均可。（合诵形式可多样，亲子合诵、家庭合诵、集体合诵均可，人数控制在5人以内）。诵读过程中，可配背景音乐或视频。</p><p>&nbsp;</p><p><br/></p>', '/attaches/image/20190314/9c532d85a4591b35407c4fc14edc4d38.jpg', '0.00', '', '新时代文明实践中心理论宣讲大厅', '18362033170', '', '2', '', '1', '1552523751', '1552524102', '1553992907', '1552524611', '25', '周志平', '0', '', '0', '0', '', '0', '', '3', '2', '0', '1', '', '1552524642', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('122', '0', '丹阳日报小记者“文明实践，石球彩绘，绘红色传奇”活动', '丹阳日报小记者“文明实践，石球彩绘，绘红色传奇”活动', '3', '<p>&nbsp; &nbsp; &nbsp; 汤甲村党建文化主题广场上有多些障碍石球，丹阳日报小记者将邀请部分热爱画画的小记者到场，发挥创意，手绘石球“靓”起来。为汤甲村党建文化主题广场增添一抹红色传奇，同时也让小记者们了解更多的党建文化。</p><p>&nbsp; &nbsp; &nbsp; 1、活动主题：绘红色传奇——“文明实践，石球彩绘”<br/></p><p>&nbsp; &nbsp; &nbsp; 2、活动目的：学习党建文化、弘扬红色文化<br/></p><p>&nbsp; &nbsp; &nbsp; 3、活动时间：2019年3月16日星期六早上9：00<br/></p><p>&nbsp; &nbsp; &nbsp; 4、活动地点：汤甲村党建文化主题广场<br/></p><p>&nbsp; &nbsp; &nbsp; 5、参与人员：丹阳日报小记者、汤甲党员若干<br/></p><p>&nbsp; &nbsp; &nbsp; 6、活动要求：穿戴小记者装备<br/></p><p>&nbsp; &nbsp; &nbsp; 7、物料准备：视参与人数丹阳日报儿童团准备&nbsp;<br/></p><p>&nbsp; &nbsp; &nbsp;8、报名联系：周老师：18362897750&nbsp; 张老师：18362897750<br/></p><p><br/></p>', '/attaches/image/20190315/b199fcd312f364d0a065cf46ab90fc67.jpg', '0.00', '', '', '', '', '2', '', '1', '1552586347', '1552611600', '1552788000', '1552626257', '1', 'admin', '0', '', '0', '0', null, '0', '', '0', '2', '0', '1', '', '1552626605', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('123', '0', '生态安葬、文明祭祀宣传及骨灰集体江葬活动', '', '4', '<p>报名时间：3月18日至4月1日，工作日的8：30-16：00。市民可自愿报名参加。</p><p>报名条件：逝者生前为丹阳市户籍人员。</p><p>内容：结合清明节，进一步深化殡葬改革，推行节地生态安葬，满足市民骨灰江葬需求。</p><p>方式：骨灰集体江葬活动。</p><p>主要负责单位：民政局，殡葬管理所</p><p><br/></p>', '/attaches/image/20190318/d1ac910928034db73f5b84d157192932.png', '0.00', '13052936510', '', '', '', '2', '', '1', '1552867218', '1552867564', '1554077167', '1552868089', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1552868104', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('124', '0', '急救知识培训', '', '4', '<p>地址：学校、社区，30-50人<br/></p><p>内容：结合3月底中小学安全教育日，展开宣传，共同保护中小学生安全。</p><p>方式：发放宣传品，树立展板，现场模拟心肺复苏讲解与体验等。</p><p>主要负责单位：卫健委、红十字会</p><p><br/></p>', '/attaches/image/20190318/21f644b61b40d5dd6bc38586ac66b15f.png', '0.00', '13052936510', '（报名后详见培训短信通知）', '', '', '2', '', '1', '1552867304', '1552868128', '1554164130', '1552868613', '25', '周志平', '50', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1552868631', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('125', '0', '抗震救灾演习', '', '4', '<p>地址：学校（报名后短信通知地点）<br/></p><p>内容：结合3月底中小学安全教育日，展开宣传，共同保护中小学生安全。</p><p>方式：现场讲解抗震救灾知识，组织现场演练并点评。发放宣传品，树立展板，提高灾害自救能力。</p><p>主要负责单位：应急管理局，教育局，相关学校。</p><p><br/></p>', '/attaches/image/20190318/6c5bcdc2fd722a0a1a053dba1687faa0.png', '0.00', '13052936510', '各中小学校', '', '', '2', '', '1', '1552867329', '1552868460', '1553991663', '1552868962', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1552868972', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('126', '0', '乡风评议', '', '4', '<p>地址：各社区、村，不限人数<br/></p><p>内容：结合清明节展开移风易俗宣传，狠刹“婚丧喜庆活动大操大办、人情债、攀比炫富”的不良风气，大树“崇德向善、勤俭节约、文明健康”之风，在全社会形成勤俭节约、文明和谐的新风正气。</p><p>方式：充分利用和发挥“文明银行”作用，完善村规民约、发挥红白事理事会作用、加强宣传引导、培树先进典型等形式，集中宣传与针对突破相结合。</p><p>主要负责单位：各镇、区（街道）</p><p><br/></p>', '/attaches/image/20190318/b96cb815aa2d725419e10177502460c8.png', '0.00', '13052936510', '村委会、社区居委会（报名后短信通知）', '', '', '2', '', '1', '1552868834', '1554078409', '1556584027', '1552869241', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1552869249', '25', '0', '0', '0', '', '', '0', '0');
