INSERT INTO `cst_activity` VALUES ('135', '0', '“禁烟护心”万人签名', '', '4', '<p>时间：2019年5月31日</p><p>地址：人民广场，不限人数</p><p>内容：结合5.31世界无烟日，展开宣传，共同保护健康。</p><p>方式：发放宣传品，树立展板，介绍与咨询，接受投诉等。</p><p>主要负责单位：卫健委、科协、烟草专卖局</p><p><br/></p>', '/attaches/image/20190318/1d82b7005aad1e102cc91f40b1e5045c.png', '0.00', '13052936510', '人民广场', '', '', '2', '', '1', '1552871030', '1556672616', '1559178224', '1552871313', '25', '周志平', '0', '', '0', '0', '', '0', '', '5', '4', '0', '1', '', '1552871319', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('137', '0', '探寻自然奥秘   成就科学梦想 —恐龙园科普活动走进丹阳各大校园', '为了让小记者了解恐龙的起源、恐龙种类和辨别方法 ，进一步掌握恐龙的进化与灭绝等方面的知识，知晓 史前生物的进化历程，丹阳日报小记者活动中心拟于3月25日--3月29日联手常州中华恐龙园，开展“探寻自然奥秘 成就科学梦想 恐龙科普讲座进校园”活动，以期激发小记者对学习、参与自然科学知识和社会实践的热情。', '0', '<p>活动主办：丹阳日报小记者志愿服务队、常州中华恐龙园　</p><p>活动时间：3月25日--3月29日</p><p>讲座时间：45分钟（前后预留1小时）</p><p>讲座内容：1、恐龙的起源&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2、恐龙的介绍和辨别</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3、恐龙的灭绝</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4、发散性提问互动环节</p><p>活动对象：各校小记者</p><p><br/></p><p><br/></p><p><br/></p>', '/attaches/image/20190318/fe25bb2648d18275645359706dab1935.png', '0.00', '0511-86526454', '丹阳市阜阳路48号', '张金科', '', '2', '', '1', '1552891062', '1553495843', '1553841457', '1552891777', '78', '丹阳日报小记者志愿服务队', '200', '', '0', '0', '', '0', '', '0', '4', '0', '1', '', '1552894923', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('138', '0', '体育大篷车  健康丹阳行(丹北镇）', '', '5', '<p>体育大篷车&nbsp; 健康丹阳行（丹北镇）</p><p>地点：飞达广场<br/></p><p>内容：舞台表演、运动健身知识方法现场教学、体质测试与评价、新项目公益推广、专家健身咨询、义诊、荧屏（体育类、文明交通类、文明生活类、卫生健康）纪录片宣传等板块。另有花式篮球、花式足球、武术套路、个人技巧、体育舞蹈、站桩教学、养生杖以及一分钟拍打功教学等体育项目展示。</p><p>安排：</p><p>1、白天</p><p>（1）开展体育健身专题讲座</p><p>邀请省健身专家开展科学健身知识和方法讲座，指导开展适合各人群的新型的健身项目教学。</p><p>（2）国民体质测试</p><p>引进国民体质监测大巴车，为现场群众开展免费的国民体质测试，由专家进行现场指导，并开具科学健身处方。</p><p>2、晚上</p><p>（1）邀请南京体育学院等高校的专业表演团队进行新颖的体育健身项目表演。</p><p>（2）开展“一镇一品”体育健身特色项目展示交流。</p><p><br/></p>', '/attaches/image/20190319/1b6104a9adb5596e626d7a09ad86aeab.png', '0.00', '13506108038', '飞达广场', '', '', '2', '', '1', '1552960237', '1554083095', '1556588701', '1552960449', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1552960458', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('139', '0', '体育大篷车  健康丹阳行（界牌镇）', '', '5', '<p>体育大篷车&nbsp; 健康丹阳行（界牌镇）</p><p>地点：界牌新村广场<br/></p><p>内容：舞台表演、运动健身知识方法现场教学、体质测试与评价、新项目公益推广、专家健身咨询、义诊、荧屏（体育类、文明交通类、文明生活类、卫生健康）纪录片宣传等板块。另有花式篮球、花式足球、武术套路、个人技巧、体育舞蹈、站桩教学、养生杖以及一分钟拍打功教学等体育项目展示。</p><p>方式：</p><p>1、白天</p><p>（1）开展体育健身专题讲座</p><p>邀请省健身专家开展科学健身知识和方法讲座，指导开展适合各人群的新型的健身项目教学。</p><p>（2）国民体质测试</p><p>引进国民体质监测大巴车，为现场群众开展免费的国民体质测试，由专家进行现场指导，并开具科学健身处方。</p><p>2、晚上</p><p>（1）邀请南京体育学院等高校的专业表演团队进行新颖的体育健身项目表演。</p><p>（2）开展“一镇一品”体育健身特色项目展示交流。</p><p><br/></p>', '/attaches/image/20190319/9617f2aa7a5e14cacd39a1d63af10f51.png', '0.00', '13506108038', '界牌新村广场', '', '', '2', '', '1', '1552960290', '1554083476', '1556589082', '1552960643', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '1', '0', '1', '', '1552960652', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('140', '0', '“踏歌新时代.文明丹阳行”开发区文化庙会非遗展演', '', '3', '<p>“踏歌新时代.文明丹阳行”开发区文化庙会非遗展演</p><p>时间：2019年3月29日上午9::00——15:30</p><p>地点：开发区眼镜市场南广场</p><p>主办：丹阳市新时代文明实践中心、中共丹阳市委宣传部、丹阳市文明办</p><p>承办：开发区新时代文明实践所、丹阳市文体广电和旅游局</p><p>活动内容概述：建设“新时代文明实践中心”是新时代文明建设工作的一件大事，通过积极探索实践，将使新时代文明实践中心成为传播好声音、弘扬主旋律、开创新业绩、凝聚干群心的主阵地，促进人居环境美、乡风民风美、文化生活美，培育农村文明风尚。</p><p>非遗项目：</p><p>1、封缸酒酿造技艺</p><p>2、乱针绣</p><p>3、天鹅绒织造技艺</p><p>4、面塑</p><p>5、剪纸</p><p>6、恒升香醋酿造技艺</p><p>7、丹埝盐水鹅制作技艺</p><p>8、赵氏二胡制作技艺</p><p>9、王氏经络推拿</p><p>10、嘉山灶马膏</p><p>11、毛笔制作技艺</p><p><br/></p>', '/attaches/image/20190327/57b39f645cb9f53ab0b4048282a556c7.png', '0.00', '13951271107', '开发区眼镜市场南广场', '', '', '2', '', '1', '1553555143', '1553558115', '1553817325', '1553558570', '25', '周志平', '0', '', '0', '0', null, '0', '', '0', '0', '0', '1', '', '1553644911', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('141', '0', '“踏歌新时代.文明丹阳行”之开发区文化庙会专场文艺演出', '', '3', '<p>“踏歌新时代.文明丹阳行”之开发区文化庙会专场文艺演出</p><p>时间：2019年3月29日下午14:00——15:30</p><p>地点：开发区眼镜市场南广场</p><p>主办：丹阳市新时代文明实践中心、中共丹阳市委宣传部、丹阳市文明办</p><p>承办：开发区新时代文明实践所、丹阳市文体广电和旅游局</p><p>活动内容概述：建设“新时代文明实践中心”是新时代文明建设工作的一件大事，通过积极探索实践，将使新时代文明实践中心成为传播好声音、弘扬主旋律、开创新业绩、凝聚干群心的主阵地，促进人居环境美、乡风民风美、文化生活美，培育农村文明风尚。</p><p>活动流程及节目单：<br/></p><p>1、开场歌舞《送吉祥》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 群星艺术团</p><p>2、武术表演&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;丹阳市虎威武道俱乐部</p><p>3、配乐诗朗诵《丹阳精神赞》&nbsp; &nbsp; &nbsp; &nbsp; 群星艺术团</p><p>4、古典舞《芙蓉雨》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 群星艺术团</p><p>5、戏曲《复兴路上看新区》&nbsp; &nbsp; &nbsp; 大泊东方艺术团</p><p>6、小品《放鞭炮》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 开发区管委会</p><p>7、广场舞《美丽中国走起来》&nbsp; &nbsp; &nbsp; &nbsp; 群星艺术团</p><p>8、女声小合唱《文明新风暖人心》&nbsp; &nbsp; 群星艺术团</p><p>9、T台走秀&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;眼镜城志愿服务队</p><p>10、黄梅戏选段《情糸黄梅》&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;群星艺术团</p><p>11、丹阳形象主题歌舞《花开别样红》 群星艺术团</p><p><br/></p>', '/attaches/image/20190326/ca261620f81f5d36c235b8a2334fd533.png', '0.00', '13951271107', '开发区眼镜市场南广场', '', '', '2', '', '1', '1553558427', '1553558775', '1553817978', '1553559145', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '1', '0', '1', '', '1553559165', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('142', '0', '丹阳市教育局举行“我为祖国点赞”主题宣讲', '', '1', '', '/attaches/image/20190326/1b946493ef4422e95b4b512bd10654d4.jpg', '0.00', '15262951760', '丹阳市练湖中心校', '王英俊', '', '2', '', '1', '1553589616', '1553754600', '1553758215', '1553590297', '653', '市教育局实践所', '0', '', '0', '0', '', '0', '', '0', '1', '0', '1', '', '1555374495', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('143', '0', '“我心中的恐龙时代”自定义征文', '', '2', '<p>征文活动如下：</p><p>主题：“我心中的恐龙时代”自定义征文<br/></p><p>说明：二至九年级的学生可每人提交1篇以“我心中的恐龙时代”为主题的作文（字数不限）。活动开展期间，丹阳日报小记者团将多次进行活动宣传报道。评选活动结束后，丹阳日报小记者团将提供版面宣传支持，集中刊登学生获奖作文。</p><p>活动时间：2019.3.25- 2019.3.29<br/></p><p>报名方式：上传作文电子档至邮箱279767230@qq.com、1967449332@qq.com<br/></p><p>咨询电话：0511-86526454&nbsp; &nbsp;18362897750张老师&nbsp; 18362896690周老师</p><p><br/></p>', '/attaches/image/20190326/deb73b3c7d56a2a61f095811b4163133.jpg', '0.00', '18362897750张老师', '', '', '', '2', '', '1', '1553592637', '1553592921', '1553852123', '1553593520', '25', '周志平', '0', '', '0', '0', '', '0', '', '1', '1', '0', '1', '', '1553593532', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('144', '0', '新时代  展新颜——庆祝新中国成立70周年笑脸图片征集活动', '', '1', '<p style=\"text-align: center;\">新时代&nbsp; 展新颜——庆祝新中国成立70周年笑脸图片征集活动</p><p>&nbsp; &nbsp; &nbsp; &nbsp;活动主题：展示全市各行各业干部群众生产、生活、工作、劳动中展现的笑脸和动人风采，分享干部群众劳动的喜悦、奉献的喜悦、幸福生活的喜悦，展示干部群众喜迎新中国成立70周年的良好精神风貌，展示全社会朝着实现中华民族伟大复兴中国梦的目标团结和谐、意气奋发、砥砺奋进的良好局面。<br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp;参与方式：按照主题内容，自主拍摄，单张照片文件大于500K， 张数不限，并通过电子邮件发送至：dyxcbxck@163.com，邮件主题统一为：“新时代&nbsp; 展新颜”开心笑脸。</p><p><br/></p>', '/attaches/image/20190327/949860f6c9548cc2bf8cb2ecbc2141c7.jpg', '0.00', '18362033170', '', '', '', '2', '', '1', '1553651227', '1554083212', '1556588818', '1553652634', '25', '周志平', '0', '', '0', '0', '', '0', '', '3', '11', '0', '1', '', '1553652659', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('145', '0', '《全面理解习近平新时代中国特色社会主义思想》', '', '1', '<p>主题：《全面理解习近平新时代中国特色社会主义思想》</p><p>时间：3月29日 上午9:00-10:00</p><p>地点：车站社区五楼会议室</p><p>主讲人:&nbsp; 朱利霞&nbsp; 中共丹阳市委党校高级讲师，丹阳市委十九大精神宣讲团成员。</p><p>内容概述：</p><p>习近平新时代中国特色社会主义思想是党的十九大精神的灵魂和主线，学习贯彻党的十九大精神，最重要的是聚焦到这一重要思想上来。</p><p>理论宣讲平台诚邀中共丹阳市委党校高级讲师朱利霞从立足时代之基、回答时代之问，领会深刻内涵、把握思想精髓，高举伟大旗帜、勇于践行担当三个方面深入解析习近平新时代中国特色社会主义思想。</p><p><br/></p>', '', '0.00', '15996830176', '车站社区五楼会议室', '', '', '2', '', '1', '1553672147', '1553672429', '1553820031', '1553672830', '25', '周志平', '100', '', '0', '0', '', '0', '', '0', '1', '0', '1', '', '1554710109', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('146', '0', '《九万里风鹏正举-跟着习总书记学诗追梦》讲座', '', '1', '<p>&nbsp; &nbsp; &nbsp; 本次讲座由丹阳市新时代文明实践中心办公室工作人员，丹阳日报社全媒体专刊二部主任、丹阳市诗词楹联学会会长赵永东分享习总书记引用和创作的经典诗词，并简要回顾我市“中华诗词之乡”创建历史。在感悟总书记治国理政的情怀与智慧、胸怀与自信的同时，共同书写新史诗。</p><p>&nbsp; &nbsp; &nbsp;&nbsp;</p>', '/attaches/image/20190328/a07b4c22c690e80e47157815854e551c.png', '0.00', '陈瑶13861348251', '建山村委会大会议室', '', '', '2', '', '0', '1553735030', '1553735076', '1553817878', '1553735512', '25', '周志平', '100', '', '0', '0', '', '0', '', '0', '1', '0', '1', '', '1553735522', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('147', '0', '《家庭教育亲子关系技巧》讲座', '', '2', '<p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; 讲座由王英俊老师从家长怎样看待自己的身份、理想的家庭环境、父母对待孩子的引导模式、因时施教、情绪教育、亲子沟通、正确对待孩子的学业、消除家长压力等方面系统地介绍亲子关系的各种技巧，为家长正确处理亲子关系提供一种简单易学而又极具可操作性的参照模式。</p><p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp; 讲座联系人：刘勤13400086878</p>', '/attaches/image/20190328/af0b35db5609ce15382c257caeb8fc89.jpg', '0.00', '刘勤13400086878', '善巷社区23楼会议室', '', '', '2', '', '1', '1553735406', '1553735636', '1553735638', '1553736023', '25', '周志平', '100', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1553736051', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('148', '0', '《眼镜行业销售技巧培训》', '', '3', '<p>&nbsp; &nbsp; &nbsp; 主讲人周建平根据眼镜行业销售现状，围绕让顾客感觉“贵”与“不贵”并不完全在于产品的好与差，更多的是通过导购的介绍和讲解如何不断提升和展示产品的价值等方面，就如何不断提升销售技巧，获得更多利润进行培训。</p><p>&nbsp; &nbsp; &nbsp; 培训联系人：邢锡根13606108133</p><p><br/></p>', '/attaches/image/20190328/3fad1304ab71dcb623ce7f2503c308ee.png', '0.00', '', '眼镜城五楼大会议室', '', '', '2', '', '1', '1553734952', '1553736194', '1553821216', '1553736788', '25', '周志平', '200', '', '0', '0', '', '0', '', '1', '0', '0', '1', '', '1553736851', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('149', '0', '《红色经典悦分享》', '', '3', '<p>&nbsp; &nbsp; &nbsp; 红色经典表现的家国情怀、社会责任感和理想信念，其追求和创造的超越一己之利的高远艺术境界，是最宝贵的文学遗产，它也是当下的，原作仍在被不断阅读、观看、欣赏，并成为当下文艺创作的一种资源。</p><p>&nbsp; &nbsp; &nbsp;活动联系人：王晶18021577077</p>', '/attaches/image/20190328/725085f3e7e166052687f71180929bbd.jpg', '0.00', '王晶18021577077', '丹阳市实验学校行政楼三楼会议室', '', '', '2', '', '1', '1553735067', '1553737890', '1553838731', '1553738288', '25', '周志平', '100', '', '0', '0', '', '0', '', '1', '0', '0', '1', '', '1553738300', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('150', '0', '2019年开发区“活力曲阿•畅享 ”乒乓球团体邀请赛', '', '5', '<p>&nbsp; &nbsp; 2019年开发区“活力曲阿•畅享‘乒’博”乒乓球团体邀请赛	</p><p>比赛时间：9:00开始全天	</p><p>地点：幸福小区	</p><p>参赛队：曲阿街道各社区（村、企业）乒乓球队</p>', '/attaches/image/20190328/32226010f942daa9b7b8f3c938211fe0.jpg', '0.00', '', '幸福小区', '', '', '2', '', '1', '0', '1553738196', '1553849799', '1553738658', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '2', '0', '1', '', '1553738689', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('151', '0', '我们都是追梦人——2019年江苏省老人体育节丹阳开发区分会场启动仪式', '', '5', '<p>我们都是追梦人——2019年江苏省老人体育节丹阳开发区分会场启动仪式</p><p>	江苏省老年人体育节开发区分会场</p><p>内容：观看老年人体育项目展示</p><p>时间：9:30</p><p>地点：锦湖社区</p>', '/attaches/image/20190328/7d0617b008766a25b1187fe1b99e2d24.jpg', '0.00', '', '锦湖社区', '', '', '2', '', '1', '1553738414', '1553738698', '1553821502', '1553739124', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1553739135', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('152', '0', '“活力曲阿”科普大篷车活动', '', '4', '<p>“活力曲阿”科普大篷车活动	</p><p>科普展示项目：辉光球、人体导电、YR互动体验、科普影视等	</p><p>时间：9:00-15:30	</p><p>地点：中国（丹阳）眼镜城南广场</p><p><br/></p>', '/attaches/image/20190328/ad100fcaa7d47ec5d8f5bcd3a317bde0.jpg', '0.00', '', '中国（丹阳）眼镜城南广场', '', '', '2', '', '1', '1553739147', '1553739162', '1553844600', '1553739514', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1553739534', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('153', '0', '2019 丹阳市“文化庙会”第3站“活力曲阿”志愿服务活动', '', '0', '<p>2019 丹阳市“文化庙会”第3站“活力曲阿”志愿服务活动</p><p>服务内容：<br/></p><p>就业、养老保险等政策咨询服务；困难救助、低保五保、养老服务、婚姻登记、扶弱助残、残疾人“两项补贴”等政策咨询服务；平安创建、户籍警务、禁放宣传等咨询服务；食品安全宣传手册发送，现场接受咨询。水价水质等业务咨询服务、水表维修等延伸服务；宣传反洗钱、抵制非法集资、金融消费者权益保护知识等；接受农业法律知识咨询，对种子、农药、兽药、农产品质量安全等方面进行宣传；有线数字电视优抚对象减免政策宣传，现场业务咨询，受理故障报修，现场维修或更换机顶盒；心肺复苏、止血包扎、火灾逃生等知识；眼镜清洗、护眼知识咨询等；煤气、天然气使用安全知识等咨询；现场为市民免费拍摄全家福活动；免费赠阅50多种千余份科技科普书刊。</p><p>服务地点：中国（丹阳）眼镜城南广场<br/></p><p>服务时间：3月29日9:00--15:30<br/></p><p>联系人：陈云宪&nbsp; 13775500592<br/></p><p><br/></p><p><br/></p>', '/attaches/image/20190328/8061375254d806bf93c8085dfa494356.jpg', '0.00', '13775500592', '中国（丹阳）眼镜城南广场', '陈云宪  13775500592', '', '2', '', '1', '1553738742', '1553741844', '1553844631', '1553742150', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '3', '0', '1', '', '1553742157', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('155', '0', '《阿米巴经营》培训', '', '4', '<p>一、课程安排：阿米巴经营 4月29日14:00-17:00&nbsp;</p><p>二、课程地点：丹阳市会展中心南区一楼报告厅<br/></p><p>三、参加人员：<br/></p><p>1、市各单位经济、科技、人才工作分管领导，各镇（街道、开发区）人社中心主任、经服中心主任、科技助理；<br/></p><p>2、全市科技型企业中高层管理人员；<br/></p><p>3、列入“丹凤朝阳”人才计划资助的创新创业人才。<br/></p><p>限250人以内。<br/></p><p>四、联系方式：<br/></p><p>参加培训的单位请于2019年4月17日前将报名表电子版发送至培训组办公邮箱gckj_ylm@126.com,由中共丹阳市委组织部、丹阳市人力资源和社会保障局、丹阳市科学技术局联合审核通过后通知具体培训事项。<br/></p><p>培训组办公室联系人：严六梅<br/></p><p>联系电话：0511-86873352-8037、13861384566<br/></p><p>邮箱：gckj_ylm@126.com&nbsp;<br/></p><p>五、嘉宾介绍：<br/></p><p>《阿米巴经营》<br/></p><p>&nbsp;过立门老师 ---京瓷阿米巴顶级实战专家，曾担任京瓷集团在中国设立的唯一一家能够提供“京瓷阿米巴经营”咨询的子公司一一京瓷阿米巴管理顾问(上海)有限公司副总经理。参与了京瓷在华的13个阿米巴项目；2015年4月出任盛中和国管理顾问(上海) 有限公司总经理，为23家企业提供了正统的阿米巴经营落地辅导服务，为近二百家企业学员提供了阿米巴经营培训，其中包括华为、上海宝钢、广州碧桂园、天津新奥等知名企业。被曹岫云会长称为 “现阶段中国最懂阿米巴经营，并能切实为企业提供有效指导的屈指可数的阿米巴专家。”<br/></p><p><br/></p>', '/attaches/image/20190401/70fed2eac78ce66cb62f8bbdd18e4d45.jpg', '0.00', '13861384566', '丹阳市会展中心南区一楼报告厅', '严六梅', '', '2', '', '1', '1554087600', '1554087903', '1556420719', '1554088266', '1', 'admin', '250', '', '0', '0', null, '0', '', '1', '2', '0', '1', '', '1554088610', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('156', '0', '《孙子兵法》培训', '', '2', '<p>一、课程安排：《孙子兵法》培训&nbsp; 5月22日14:00-17:00&nbsp;</p><p>二、课程地点：丹阳市会展中心南区一楼报告厅<br/></p><p>三、参加人员：<br/></p><p>1、市各单位经济、科技、人才工作分管领导，各镇（街道、开发区）人社中心主任、经服中心主任、科技助理；<br/></p><p>2、全市科技型企业中高层管理人员；<br/></p><p>3、列入“丹凤朝阳”人才计划资助的创新创业人才。<br/></p><p>限250人以内。<br/></p><p>四、联系方式：</p><p>参加培训的单位请将报名表电子版发送至培训组办公邮箱gckj_ylm@126.com,由中共丹阳市委组织部、丹阳市人力资源和社会保障局、丹阳市科学技术局联合审核通过后通知具体培训事项。</p><p>培训组办公室联系人：严六梅<br/></p><p>联系电话：0511-86873352-8037、13861384566<br/></p><p>邮箱：gckj_ylm@126.com&nbsp;<br/></p><p>五、嘉宾介绍：</p><p>《孙子兵法》</p><p>于长滨老师---天津南开大学戈德进修学院副院长，MBA导师、山西省焦炭行业协会市场 营销总监、中国注册职业经理人 国家级专家评委。于长滨教授是中国著名的“《孙子兵法》与营销实战”研究专家，被誉为“《孙子兵法》实战第一人”。从1983年起，于长滨教授潜心研究 《孙子兵法》与企业（营销）战略20余年，成果颇丰。从1995年开始，于长滨应各大高校、企业及著名培训机构邀请讲授《孙子兵法与营销战略》百余场，好评如潮。</p><p><br/></p>', '/attaches/image/20190401/f5e6204168b99df1c63b84092ebf27ee.jpg', '0.00', '13861384566', '丹阳市会展中心南区一楼报告厅', '严六梅', '', '2', '', '1', '1554097805', '1554097913', '1558417917', '1554098136', '25', '周志平', '250', '', '0', '0', null, '0', '', '0', '1', '0', '1', '', '1554098331', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('157', '0', '《王阳明心学》培训', '', '2', '<p>一、课程安排：《王阳明心学》培训&nbsp; &nbsp;6月26日 14:00-17:00</p><p>二、课程地点：丹阳市会展中心南区一楼报告厅</p><p>三、参加人员：</p><p>1、市各单位经济、科技、人才工作分管领导，各镇（街道、开发区）人社中心主任、经服中心主任、科技助理；<br/></p><p>2、全市科技型企业中高层管理人员；</p><p>3、列入“丹凤朝阳”人才计划资助的创新创业人才。</p><p>限250人以内。</p><p>四、联系方式：</p><p>参加培训的单位请将报名表电子版发送至培训组办公邮箱gckj_ylm@126.com,由中共丹阳市委组织部、丹阳市人力资源和社会保障局、丹阳市科学技术局联合审核通过后通知具体培训事项。<br/></p><p>培训组办公室联系人：严六梅<br/></p><p>联系电话：0511-86873352-8037、13861384566<br/></p><p>邮箱：gckj_ylm@126.com&nbsp;<br/></p><p>五、嘉宾介绍：<br/></p><p>《王阳明心学》</p><p>董平老师---1959年9月4日出生，浙江衢州人，现任浙江大学哲学系教授、博士生导师，浙江大学中国思想文化研究所所长、浙江省文史研究馆馆员，2010年3月28日起在百家讲坛主讲《名相管仲》，2010年12月10日起在百家讲坛主讲《传奇王阳明》。兼任中国哲学史学会理事、中国实学研究会理事、中国孔子基金会学术委员，复旦大学儒学研究中心兼职研究员，北京大学《儒藏》编纂中心编委，浙江文献集成编纂中心副主任。2015年10月当选中华孔子学会副会长。</p><p><br/></p>', '/attaches/image/20190401/622c83a61415ecadd99c8e65199ac8e3.jpg', '0.00', '13861384566', '丹阳市会展中心南区一楼报告厅', '严六梅', '', '1', '', '0', '1554097541', '1554098305', '1561442314', '1554098626', '25', '周志平', '250', '', '0', '0', null, '0', '', '2', '2', '0', '1', '', '1556610055', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('158', '0', '《工匠之道：新工匠精神培育与缔造》', '', '2', '<p>一、课程安排：《工匠之道：新工匠精神培育与缔造》培训&nbsp; &nbsp;7月24日 14:00-17:00&nbsp;</p><p>二、课程地点：丹阳市会展中心南区一楼报告厅</p><p>三、参加人员：<br/></p><p>1、市各单位经济、科技、人才工作分管领导，各镇（街道、开发区）人社中心主任、经服中心主任、科技助理；<br/></p><p>2、全市科技型企业中高层管理人员；<br/></p><p>3、列入“丹凤朝阳”人才计划资助的创新创业人才。<br/></p><p>限250人以内。<br/></p><p>四、联系方式：<br/></p><p>参加培训的单位请将报名表电子版发送至培训组办公邮箱gckj_ylm@126.com,由中共丹阳市委组织部、丹阳市人力资源和社会保障局、丹阳市科学技术局联合审核通过后通知具体培训事项。<br/></p><p>培训组办公室联系人：严六梅<br/></p><p>联系电话：0511-86873352-8037、13861384566<br/></p><p>邮箱：gckj_ylm@126.com&nbsp;<br/></p><p>五、嘉宾介绍：<br/></p><p>《工匠之道：新工匠精神培育与缔造》</p><p>蒋小华老师----新工匠精神的提出者与倡导者、“最佳执行企业教练”、 曾任世界500强企业总经理室经理职务、曾任大型台资企业总裁助理职务、 曾获“中国管理咨询行业十佳杰出人物”等荣誉。著有《为结果而战：打造以结果为导向的执行模式》《咫尺匠心：新工匠是怎样炼成的》等书专长：工匠精神、领导力、执行力、中高层管理技能、互联网思维。蒋老师拥有10年在外企、私企的管理实践，专门从事过管理咨询顾问工作，积累了丰富的管理实战经验；11年授课经验，培训了1000多家企业，参训人数达到10万人以上，积累了丰富的实战管理和培训经验，特别在领导力、执行力、工匠精神方面造诣斐然，成为企业首选教练。课程以操作性、实用性见长，以学员为主体，引导与启发学员，培训满意度在95分以上。</p><p>中国企业转型升级的关键时期，迫切需要传承与回归工匠精神。蒋老师从多年前就致力于“工匠精神”研究与管理实践，深入研究与走访日本、德国等企业的工匠文化；另外，对互联网、新媒体等新生事物具有丰富的实践经验与理论研究。他是集经验、理论与实践于一身的管理实践者。</p><p><br/></p>', '/attaches/image/20190401/9790456091af3316aad12e0df9ee8b05.jpg', '0.00', '13861384566', '丹阳市会展中心南区一楼报告厅', '严六梅', '', '1', '', '1', '1554098453', '1554098609', '1563861820', '1554099000', '25', '周志平', '250', '', '0', '0', '', '0', '', '2', '5', '0', '1', '', '1554099013', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('159', '0', '《组织重启、事业合伙人、灵活用工落地及风险》培训', '', '2', '<p>一、课程安排：《组织重启、事业合伙人、灵活用工落地及风险》培训&nbsp; &nbsp;8月28日 14:00-17:00&nbsp;&nbsp;</p><p>二、课程地点：丹阳市会展中心南区一楼报告厅</p><p>三、参加人员：</p><p>1、市各单位经济、科技、人才工作分管领导，各镇（街道、开发区）人社中心主任、经服中心主任、科技助理；<br/></p><p>2、全市科技型企业中高层管理人员；<br/></p><p>3、列入“丹凤朝阳”人才计划资助的创新创业人才。<br/></p><p>限250人以内。<br/></p><p>四、联系方式：<br/></p><p>参加培训的单位请将报名表电子版发送至培训组办公邮箱gckj_ylm@126.com,由中共丹阳市委组织部、丹阳市人力资源和社会保障局、丹阳市科学技术局联合审核通过后通知具体培训事项。<br/></p><p>培训组办公室联系人：严六梅<br/></p><p>联系电话：0511-86873352-8037、13861384566<br/></p><p>邮箱：gckj_ylm@126.com&nbsp;<br/></p><p>五、嘉宾介绍：<br/></p><p>《组织重启、事业合伙人、灵活用工落地及风险》</p><p>魏浩征老师---在劳动法和人力资源领域拥有近20年经验，上海人才服务行业协会副会长、专家顾问；北京中关村人才协会劳动关系首席顾问；清华大学、上海交通大学、中山大学等知名高校兼职教授、总裁班特聘培训师；《人力资源》杂志领衔专家。劳动法和员工关系领域的顶尖专家，担任数十家500强企业常年顾问，主持企业并购、裁员、搬迁、关厂、高管处理、组织变革、HR外包、员工关系体系建设、人力成本筹划、劳动争议处理等重大咨询项目数百起，出版《裁员误区及风险控制》、《经历3+1》等近二十部专著。</p><p><br/></p>', '/attaches/image/20190401/af90830cc8710e5d4fa5c3c15fb9d1ae.jpg', '0.00', '13861384566', '丹阳市会展中心南区一楼报告厅', '严六梅', '', '1', '', '1', '1554099041', '1554099081', '1566886294', '1554099396', '25', '周志平', '250', '', '0', '0', '', '0', '', '8', '7', '0', '1', '', '1554099411', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('161', '0', '《全面理解习近平新时代中国特色社会主义思想》', '', '1', '<p>主题：《全面理解习近平新时代中国特色社会主义思想》</p><p>时间：4月10日 上午9:00-11:00<br/></p><p>地点：陵口镇新陵村委会<br/></p><p>主讲人:&nbsp; 朱利霞&nbsp; 中共丹阳市委党校高级讲师，丹阳市委十九大精神宣讲团成员。</p><p>内容概述：</p><p>习近平新时代中国特色社会主义思想是党的十九大精神的灵魂和主线，学习贯彻党的十九大精神，最重要的是聚焦到这一重要思想上来。</p><p>理论宣讲平台诚邀中共丹阳市委党校高级讲师朱利霞从立足时代之基、回答时代之问，领会深刻内涵、把握思想精髓，高举伟大旗帜、勇于践行担当三个方面深入解析习近平新时代中国特色社会主义思想。<br/></p><p><br/></p>', '/attaches/image/20190408/a1d3a2457554142c540610dece7060d3.jpg', '0.00', '15996830176', '新陵村委会', '', '', '2', '', '1', '1554709212', '1554709977', '1554857580', '1554710395', '25', '周志平', '100', '', '0', '0', '', '0', '', '1', '1', '0', '1', '', '1554710406', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('162', '0', '《隔代亲,祖辈情——家庭教育讲座》', '', '2', '<p>主题：《隔代亲,祖辈情——家庭教育讲座》				</p><p>时间：4月10日 14:30-15:30<br/></p><p>地点：陵口中心校<br/></p><p>主讲人: 鞠秋红<br/></p><p>内容概述：<br/></p><p>针对祖辈（爷爷奶奶、外公外婆）的家庭教育。<br/></p><p><br/></p>', '/attaches/image/20190408/d5f8e75dc62b055ffb14d2174a9c292f.jpg', '0.00', '13775500592', '陵口中心校', '', '', '2', '', '1', '1554706848', '1554710423', '1554868825', '1554710763', '25', '周志平', '200', '', '0', '0', '', '0', '', '1', '0', '0', '1', '', '1554710770', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('163', '0', '《心脑血管疾病的预防及控制》', '', '4', '<p>主题：《心脑血管疾病的预防及控制》			</p><p>时间：4月10日 10:00-11:00<br/></p><p>地点：陵口村委会<br/></p><p>主讲人: 潘生英<br/></p><p>内容概述：<br/></p><p>心脑血管疾病是心脏血管和脑血管疾病的统称，泛指由于高脂血症、血液黏稠、动脉粥样硬化、高血压等所导致的心脏、大脑及全身组织发生的缺血性或出血性疾病。心脑血管疾病是一种严重威胁人类，特别是50岁以上中老年人健康的常见病，具有高患病率、高致残率和高死亡率的特点，即使应用目前最先进、完善的治疗手段，仍可有50%以上的脑血管意外幸存者生活不能完全自理，全世界每年死于心脑血管疾病的人数高达1500万人，居各种死因首位。</p><p>心脑血管疾病的预防包括一级预防和二级预防，一级预防是指发病前的预防，即无病防病发生；二级预防是为了降低再次发生的危险及减轻致残率，即患病后防止再发病。</p><p>1.防止栓塞</p><p>血管尤其是冠状动脉，冬季寒冷时容易收缩、痉挛，发生供血不足，并可能导致栓塞，要十分注意保暖。高危患者进行有效的抗栓治疗，可在医生指导下长期服用阿司匹林等。</p><p>2.患者晨练应注意的问题</p><p>睡眠时，人体各神经系统处于抑制状态，活力不足，晨起时突然大幅度锻炼，神经兴奋性突然增高，极易诱发心脑血管疾病，冬季应该注意。</p><p>3.改变不良的生活方式</p><p>不良生活方式是导致心脑血管疾病的发生、发展的重要因素，直接影响疾病的康复与预后。控制饮食总量，调整饮食结构；坚持运动，循序渐进，量力而行，持之以恒；戒烟少酒，劳逸结合；减少钠盐摄入，每天食盐控制在5g以内；增加钾盐摄入，每天钾盐≥4.7g。</p><p>4.多吃富含精氨酸的食物</p><p>富含精氨酸的食物有助调节血管张力、抑制血小板聚集，减少血管损伤。这类食物有海参、泥鳅、鳝鱼及芝麻、山药、银杏、豆腐皮、葵花子等。</p><p>5.控制血压和血脂是关键</p><p>（1）血压控制 将血压控制在一个比较理想的范围内，是预防心脑血管疾病的重中之重。资料表明，坚持长期治疗的高血压患者心脑血管疾病的发病率，仅为不坚持治疗者的1/10，也就是说，只要长期坚持控制血压，心脑血管疾病发病可下降90%。</p><p>（2）血脂控制 如果血脂过多，容易造成“血稠”，在血管壁上沉积，逐渐形成小斑块，就是人们常说的动脉粥样硬化，引发各种心脑血管疾病。常见的血脂控制是服用调脂药物：包括他汀类，贝特类，烟酸等。血脂异常是心脑血管疾病的独立危险因素，控制血脂也成为心脑血管疾病防治的重中之重。</p><p>6.进补要适度</p><p>我国民间素有冬季进补的习惯，冬季人们运动本来就少，加之大量进补热性食物和滋补药酒，很容易造成血脂增高，诱发心脑血管疾病，因此冬季进补一定要根据个人的体质进行。</p><p>解读词条背后的知识。</p><p><br/></p>', '/attaches/image/20190408/549f7a0cecee444403618015a8afb01b.jpg', '0.00', '13912825666', '陵口村委会', '', '', '2', '', '1', '1554710704', '1554710801', '1554860750', '1554711109', '25', '周志平', '200', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1554711126', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('164', '0', '《企业、员工和谐关系构建》', '', '2', '<p>主题：《企业、员工和谐关系构建》					</p><p>时间：4月10日 14:00-15:30</p><p>地点：陵口镇远燕医疗企业</p><p>主讲人: 纪剑卿</p><p>内容概述：</p><p>重点讲解“企业规范用工系列范本”、相关劳动用工政策法律法规、用工风险和劳动争议防范化解技能技巧等，结合企业实际案例，围绕劳动合同与集体合同的签订、如何有效处理违纪员工、离职员工管理风险防范、如何设计与撰写好人力资源制度等四大方面的劳务风险内容，深入浅出地解读最新的劳动法律法规，详细讲解签订劳动合同的注意事项、常见的“无效条款”、集体合同与劳动合同的区别、即时通知解除（过失性解除）劳动合同、如何向员工出具相关通知书及文书送达、离职员工关系管理、企业劳动规章制度的基本内容、企业规章制度的风险防范等企业实用性的内容。</p><p><br/></p>', '/attaches/image/20190408/8666a22b7867f358d90775a31e60bd28.jpg', '0.00', '13912840260', '陵口镇远燕医疗企业', '', '', '2', '', '1', '1554711024', '1554711180', '1554873182', '1554711477', '25', '周志平', '200', '', '0', '0', '', '0', '', '0', '2', '0', '1', '', '1554711496', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('165', '0', '《企业安全生产》', '', '2', '<p>主题：《企业安全生产》			</p><p>时间：4月10日 16:00-17:00</p><p>地点：陵口镇远燕医疗企业</p><p>主讲人: 纪剑卿</p><p>内容概述：</p><p>重点讲解安全生产基本常识、安全心理学基本常识、事故预防基本知识、事故预防控制技术、风险管理基本知识、机械安全基本知识、电气安全基本知识、消防安全基本知识、特种设备安全基本知识、交通安全基本知识、施工作业安全基本知识、危险化学品安全基本知识、现场急救基本知识、安全社区基本知识、安全生产法规基本知识、企业安全生产规章制度知识等。</p><p><br/></p>', '/attaches/image/20190408/223fa677d9909a00a2c18ea0fc516432.jpg', '0.00', '13912840260', '陵口镇远燕医疗企业', '', '', '2', '', '1', '1554711049', '1554711619', '1555401633', '1554711887', '25', '周志平', '0', '', '0', '0', '', '0', '', '1', '2', '0', '1', '', '1554711899', '25', '0', '0', '0', '', '', '0', '0');
