INSERT INTO `cst_activity` VALUES ('228', '0', '丹阳市“同唱祖国好 幸福舞起来 ------ 2019年‘舞动江苏’广场舞大赛”西部片区赛', '', '5', '<p>丹阳市“同唱祖国好 幸福舞起来 ------ 2019年‘舞动江苏’广场舞大赛”西部片区赛</p><p>一、主办单位：<br/></p><p>丹阳市新时代文明实践中心办公室</p><p>中共丹阳市委宣传部</p><p>丹阳市文明办</p><p>市文体广电和旅游局</p><p>三、协办单位：</p><p>丹阳市社会体育指导员协会</p><p>丹阳市思博英体育产业发展有限公司</p><p>四、比赛时间：</p><p>&nbsp; &nbsp; &nbsp;6月1日下午14:30举行西部片区赛。</p><p>五、</p><p>西部片区参赛出场顺序：</p><p>第一场	&nbsp; &nbsp; 花儿这样红	 3分36秒	云阳街道银梦艺术团</p><p>	第二场	&nbsp; &nbsp; 扇子舞：我的祖国	4分28秒	司徒镇夕阳红艺术团</p><p>	第三场	唱家乡	3分30秒	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;珥陵皮埃诺舞蹈队</p><p>	第四场	珊瑚颂	3分35秒	珥陵东方韵舞蹈队</p><p>	第五场	舞蹈：我的祖国	4分30秒	司徒镇东风舞蹈队</p><p>	第六场	中国歌最美	3分47秒	延陵镇行宫村代表队</p><p>	第七场	吉祥藏历年	3分33秒	皇塘梦之韵代表队</p><p>	第八场	中国脊梁	4分16秒	云阳街道木兰艺术代表队</p><p>	第九场	好一朵女人花	3分57秒	导墅镇里庄金凤凰舞蹈队</p><p>	第十场	我和我的祖国	3分18秒	老年体协葆春艺术团</p><p>	第十一场	共筑中国梦	3分02秒	延陵镇文体中心代表队</p><p>	第十二场	我和我的祖国	3分18秒	皇塘镇蒋墅村代表队</p><p>	第十三场	共筑中国梦	3分02秒	导墅镇轻舞飞阳代表队</p><p>	第十四场	女儿情	4分32秒	云阳街道云之梦代表队</p><p><br/></p><p><br/></p>', '/attaches/image/20190530/bf0962fcf10633cabdcd6afe9bba463f.jpg', '0.00', '0511-86578962', '市奥体馆', '张叶雯', '', '2', '', '1', '1559174722', '1559176016', '1559379600', '1559176527', '25', '周志平', '0', '', '0', '0', '', '0', '', '0', '1', '0', '1', '', '1559176536', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('229', '0', '丹阳市“同唱祖国好 幸福舞起来 ------ 2019年‘舞动江苏’广场舞大赛”东部片区赛', '', '5', '<p>丹阳市“同唱祖国好 幸福舞起来 ------ 2019年‘舞动江苏’广场舞大赛”东部片区赛</p><p>一、主办单位：<br/></p><p>丹阳市新时代文明实践中心办公室</p><p>中共丹阳市委宣传部</p><p>丹阳市文明办</p><p>市文体广电和旅游局</p><p>三、协办单位：</p><p>丹阳市社会体育指导员协会</p><p>丹阳市思博英体育产业发展有限公司</p><p>四、比赛时间：</p><p>&nbsp; &nbsp; &nbsp;6月2日下午14:30举行西部片区赛。</p><p>五、东部片区参赛出场顺序：</p><p>第一场	让我听懂你的语言	4分10秒	开发区练湖新城舞蹈队<br/></p><p>	第二场	爱我中华	3分51秒	开发区嘉荟新城舞蹈队</p><p>	第三场	心上的罗加	4分23秒	开发区金凤凰艺术团</p><p>	第四场	感谢好生活	3分25秒	界牌东方艺术团</p><p>	第五场	和谐中国	4分钟	陵口镇陵口村华韵舞蹈队</p><p>	第六场	多嘎多耶	3分26秒	吕城镇运河中心炫舞健身队</p><p>	第七场	我和我的祖国	3分21秒	丹阳市群星艺术团</p><p>	第八场	梨花情	3分53秒	丹北镇舞韵舞蹈代表队&nbsp;</p><p>	第九场	缥缃醉	3分43秒	陵口镇文体中心代表队</p><p>	第十场	吉祥	4分01秒	丹北镇群楼代表队</p><p>	第十一场	女人花	3分25秒	访仙镇窦庄村舞蹈队</p><p>	第十二场	我和我的祖国	3分18秒	丹北镇代表队</p><p>	第十三场	共筑中国梦	3分02秒	吕城镇艺翎舞蹈艺术团</p><p>	第十四场	城市山林	3分59秒	访仙镇文体中心代表队</p><p>	第十五场	采薇	4分10秒	界牌扬子江艺术团</p><p><br/></p>', '/attaches/image/20190530/d91d975b9cc73786075cc80df9eec25d.jpg', '0.00', '0511-86578962', '市奥体馆', '张叶雯', '', '2', '', '1', '1559174728', '1559176445', '1559466000', '1559176749', '25', '周志平', '0', '', '0', '0', '', '0', '', '1', '0', '0', '1', '', '1559176760', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('231', '0', '“书记项目”志愿活动', '为大力支持本村重点项目建设，马陵村组织志愿者对其进行义务劳动。', '0', '<p>&nbsp; &nbsp; &nbsp; &nbsp; 我村“书记项目”-----江苏省香海琴枫浪漫庄园，开园在即，5月11日至5月17日，马陵村委会为大力支持此项工作，组织志愿者队伍对园区进行了大面积的美化环境、清除杂物义务活动。</p><p>　　活动中，志愿者们激情高昂工作积极，以实际行动为我们的“书记项目”能顺利的建设开展，作出了自己的贡献。</p><p><br/></p>', '/attaches/image/20190530/dec2f0423cafb406139773154cc6e7d0.jpg', '0.00', '13914583582', '马陵村江苏香海琴枫浪漫庄园', '张生方', '', '2', '', '1', '1557453090', '1557539457', '1558085407', '1559181692', '255', '马陵村', '50', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1559202372', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('232', '0', '长江大保护', '长江堤坝垃圾清理', '0', '<p></p><img src=\"/attaches/image/20190603/155953248723285.jpg\"/><img src=\"/attaches/image/20190603/155953248657244.jpg\"/><img src=\"/attaches/image/20190603/155953248733667.jpg\"/><img src=\"/attaches/image/20190603/155953248641399.jpg\"/>', '/attaches/image/20190603/382f5575ac2c344eea7242283e1787e3.jpg', '0.00', '18652880800', '保港闸', '2', '', '2', '', '1', '1559265735', '1559348471', '1559359333', '1559532531', '609', '界中社区', '20', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1559539953', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('233', '0', '井园村端午志愿者活动-“粽情粽意”慰问走访困难群众', '端午来领之际，井园村志愿者服务分队包粽子，走访慰问困难群众。弘扬志愿者服务精神，组里我村困难群众树立脱贫致富信心。', '0', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 井园村志愿者服务分队“粽情粽意”包粽子走访困难群众</p><p>&nbsp;</p><p>&nbsp; &nbsp;“五月五，过端午，粽叶青，糯米香;挂菖蒲，带香包...”一年一度的中国传统节日——端午节即将到来,我村忙里偷闲于2019年6月5日下午，开展“粽情粽意”志愿服务活动，并邀请我村帮扶单位市信访局与我村村民黄红花等一起动手包粽子，营造了浓厚的节日氛围。</p><p>&nbsp; &nbsp;这次活动，我们请行家为大家展示包粽子的手法和技巧，折粽叶、填糯米、裹叶子、扎线...在老师傅的巧手下，没一会儿一个个鲜绿的粽子就诞生了。在我们的志愿者队伍里，很多是现学现卖的年轻人，包粽子时屡屡出现“纰漏”，好不容易包好了粽叶，糯米又漏了出来。尽管技术参差不齐，但大家都很尽兴。</p><p>&nbsp; &nbsp;</p><p><img src=\"/attaches/image/20190605/155972160241902.jpg\"/></p><p><img src=\"/attaches/image/20190605/155972160247957.jpg\"/></p><p><img src=\"/attaches/image/20190605/155972160226221.jpg\"/></p><p><img src=\"/attaches/image/20190605/155972160272195.jpg\"/></p><p><img src=\"/attaches/image/20190605/155972160386143.jpg\"/></p><p>活动结束后，村干部和市信访局志愿者们一起走访了村里的困难群众，给他们送去了漂亮的粽子和节日的慰问，让他们感受节日的温馨气氛和大家伙深切的关爱。<br/></p><p>通过此次活动，村两委干部和信访局志愿者们用这份“粽情粽意”助力了我村的困难群众树立脱贫致富的信心，弘扬了志愿服务精神，志愿者们在服务他人的同时也实现了个人价值，获得了满足感幸福感。</p><p><br/></p>', '/attaches/image/20190605/1c9d710313f83e2d5d4b236899e1a6bd.jpg', '0.00', '15105284233', '井园村委会', '梅鸯', '', '2', '', '1', '1559634927', '1559710512', '1559721321', '1559721635', '499', '井园村', '20', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1559721792', '40', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('235', '0', '江南人家爱社区“粽叶飘香迎端午 幸福和谐邻里情”端午节活动', '在端午佳节临近之际，为了让社区居民深入了解传统节日、传承文化习俗，增强社区凝聚力，增进邻里和谐。江南人家社区于6月5日下午，在社区活动室举办了以“粽叶飘香迎端午 幸福和谐邻里情”为主题的包粽子，献爱心活动。', '0', '<p>&nbsp; &nbsp; &nbsp;在端午佳节临近之际，为了让社区居民深入了解传统节日、传承文化习俗，增强社区凝聚力，增进邻里和谐。江南人家社区于6月5日下午，在社区活动室举办了以“粽叶飘香迎端午 幸福和谐邻里情”为主题的包粽子，献爱心活动。</p><p>&nbsp; &nbsp; 活动当天，社区志愿者、党员一起现场包粽子。在大家的努力下200多个粽子很快就包好了。志愿者第一时间将粽子送到了困难家庭、残疾人等弱势群体家中，让他们在节日中真切感受到党和政府的关爱，感受到社区大家庭的温暖。</p><p><br/></p>', '/attaches/image/20190606/6705f38f3b71b8b3df7c081406c96212.png', '0.00', '', '', '', '', '2', '', '1', '1559611114', '1559707200', '1559721600', '1559784184', '305', '江南人家社区', '0', '', '0', '0', '', '0', '', '0', '0', '0', '1', '', '1559785729', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('236', '0', '关爱老人 粽叶飘香', '', '0', '<p>&nbsp; &nbsp; &nbsp; &nbsp;为进一步弘扬中华民族优秀传统文化。6月5日上午7点，双茆村新时代文明实践站在东茆孙祠堂组织志愿者们开展“关爱老人 亲情服务”活动，主要由志愿者们组织老人开展包粽子活动。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;活动中，志愿者拿出提前准备好的食材分发给大家，老人们很开心，开始展示包粽子的手艺，对不会包的老人们志愿者们会认真地教他们，老人们也会彼此互相探讨心得。整个活动现场和谐温暖。活动结束后实践站还收到了安康通访仙服务站赠送的锦旗“尊老敬老 大爱无疆”，后续将继续发扬中华传统美德，将爱一直延续下去。</p><p><br/></p>', '/attaches/image/20190606/5f3527c0c6771de8daffbb18552cc337.jpg', '0.00', '', '', '', '', '2', '', '1', '0', '1559689200', '1559700000', '1559790280', '539', '双茆村', '0', '', '0', '0', '', '0', '', '0', '0', '1', '1', '', '1559790852', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('237', '0', '珥陵初中推进大规模组团式家访活动', '近日，学校利用周末时间，组织全校班主任、行政、任课教师走村串户进行家访活动。', '0', '<p>&nbsp; &nbsp; &nbsp; &nbsp;5月底6月初，学校利用周末时间，组织全校班主任、行政、任课教师走村串户进行家访活动。家访前，每个班对家访人员，家访内容以及工作要求作了详细的安排，尤其针对贫困生、学困生、单亲学生、家庭发生重大变故学生、外来务工人员子女、残疾学生、留守儿童进行重点家访。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;走出校园，才让我们更明白教育更多的是发生在家庭，发生在细微的生活里；通过家访，才让我们更清楚父母之爱是孩子前行的最大动力；在家庭里遇见孩子，才让我们更看懂学生多面的个性和丰富的生活，让教师打开一扇全方位了解学生的窗户，除了分数，更多的还有真善美的底色。家访让老师更悦纳自己的学生！</p><p>&nbsp; &nbsp; &nbsp; &nbsp;在此次活动中，老师们也感受到了家长们的极大热情，每到一个家庭，都能看到家长一张张热情的笑脸，都能在轻松的氛围中和家长进行亲切的交流。家长们对老师前来家访的教育行为非常感动，并纷纷表示积极配合学校的工作。家访拉近了教师与家长的距离，让孩子感受到了老师的关爱，让家长感受到了学校的温暖，爱在家访路上延伸家访拉近了教师与家长的距离，让孩子们感受到了老师的关爱，让家长感受到了学校的温暖。教育因为家访而温暖，家访因为教育而丰富。&nbsp;&nbsp;<br/></p><p><br/></p>', '/attaches/image/20190606/a769520f3a9893c11829e8d86436f418.jpg', '0.00', '051186692270', '受访学生家庭住址', '陈宇 孙建', '', '2', '', '1', '1558768083', '1558854406', '1559977652', '1559805669', '1227', '钟东华', '30', '', '0', '0', null, '0', '', '0', '0', '1', '1', '', '1560125925', '25', '0', '0', '0', '', '', '0', '0');
INSERT INTO `cst_activity` VALUES ('238', '0', '白兔村党员志愿者队伍参加秸秆禁烧活动', '为进一步落实皇塘镇桔秆禁烧的工作要求，防治大气污染，促进资源节约，保护生态环境，保证城乡居民正常生产生活秩序，扎实开展秸秆禁烧工作。为做好秸秆禁烧工作，我镇实行分管领导包镇、机关干部包村、党员志愿者包户的管理责任制，完善执法监督，严格执行焚烧秸秆责任追究制度。每年收割后，农户都习惯趁天气晴朗的时候，在田里焚烧秸秆，影响环境和空气质量。5月20日，皇塘镇白兔村成立一支党员志愿者队伍后，穿着“实践站志愿者”服装和戴着“红袖章”的党员巡逻到田间地头，发现农户焚烧秸秆及时阻止，劝导将秸秆堆积处理。', '0', '<p>&nbsp; &nbsp; &nbsp; &nbsp;为进一步落实皇塘镇桔秆禁烧的工作要求，防治大气污染，促进资源节约，保护生态环境，保证城乡居民正常生产生活秩序，扎实开展秸秆禁烧工作。为做好秸秆禁烧工作，我镇实行分管领导包镇、机关干部包村、党员志愿者包户的管理责任制，完善执法监督，严格执行焚烧秸秆责任追究制度。皇塘镇白兔村成立一支党员志愿者队伍后，穿着“实践站志愿者”服装和戴着“红袖章”的党员巡逻到田间地头，发现农户焚烧秸秆及时阻止，劝导将秸秆堆积处理。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;我村将继续发挥党员志愿者的作用，走村入户进行不间断宣传督导，确保秸秆禁烧的同时，引导广大村民秸秆还田，从源头上减少农村“六大堆”出现。</p>', '/attaches/image/20190607/d9ed18f1e1a6a749e78a5ebe27fe46bb.jpg', '0.00', '15252934433', '白兔村', '吴雅丹', '', '1', '', '1', '1559955600', '1559957400', '1561887000', '1559897258', '457', '白兔村', '50', '', '0', '0', null, '0', '', '1', '0', '0', '1', '', '1559954301', '38', '0', '0', '0', '', '', '0', '0');
