INSERT INTO `cst_volunteer_group` VALUES ('25', '0', '丹阳爱心义工社', '', '', null, '丹阳爱心义工社是由社会爱心人士依法发起组建的民间团体，成立于2017年10月18日，社员中有公务员、教师、医务工作者、企业家、社会自由者等各界人物，倡导“参与、互助、奉献、进步”的服务精神，传播“助人自助”、“送人玫瑰、手有余香”的互助理念，关爱弱势群体，关注青少年健康，热心公益事业。《每个人都是一盏灯, 一个人的力量是薄弱的, 一盏灯不足以照亮 大地。 丹阳爱心义工社为大家提供一个平台, 让 有爱的我们聚集在一起, 用我们的光照亮社会, 以我们的力量去帮助 那些需要帮助的人》。我们怀着感恩的心，强烈的责任与使命，以平凡的实事，务实的点滴，只为付出与耕耘，不计回报与名利。 我们希望通过自己的努力带动和激发更多爱心人士参与到社会公益服务的大家庭来。《路漫漫其修远兮，吾将上下而求索——大爱无疆，公益之路，愿与你同行，丹阳爱心义工社在线时刻等候你。》丹阳爱心义工社QQ598498974', '/uploads/20190911/e23d05393246a6b49f4c5a6d2152aefa.jpg', '', '18', '0', '1543043336', '', '', '1', null, '0', '0', '');
INSERT INTO `cst_volunteer_group` VALUES ('26', '0', '丹阳市中华传统文化学会', '', '', null, '丹阳市中华传统文化学会成立于2012年，是一家经民政部门核准，在宣传部文明委领导下从事优秀传统文化传承工作的社会公益组织。学会创办以来，在各级领导和各位专家的关心指导下，坚持社会主义核心价值观，秉承“弘扬国学传善义，自我修养存善德，公益扶助行善”的办会理念，积极开展以国学经典讲读为主要内容的传统文化传播活动，弘扬正能量，通过进学校、进家庭、进社区、进企业，创建了专家指导、义工参与、企业协助、公益性质、小手拉大手的丹阳模式。', '/uploads/20190911/e23d05393246a6b49f4c5a6d2152aefa.jpg', '', '18', '0', '1543043542', '', '', '1', null, '0', '0', '');
INSERT INTO `cst_volunteer_group` VALUES ('27', '0', '丹阳市齐梁义工社', '', '', null, '齐梁义工社成立于2015年9月，义工社主要成员是本地各行各业有志于奉献公益慈善事业的人士。目前在册义工人数七百多人，其中持有义工证200多人，活动经费主要来源于社团义工自筹，实行账目公开，所有活动和经费支出我们都积极主动接受主管单位，相关第三方和每位义工的监督。', '/uploads/20190911/e23d05393246a6b49f4c5a6d2152aefa.jpg', '', '18', '0', '1543043617', '', '', '1', null, '0', '0', '');
INSERT INTO `cst_volunteer_group` VALUES ('28', '0', '丹阳市如意慈善公益服务团', '', '', null, '丹阳市如意慈善公益服务团简称“如意慈善”，前身为逍遥如意群，组建于2014年元月，2016年11月完成正式注册登记。“如意慈善”是一个由社会各界爱心人士依法发起设立的民间公益团体，他们中有政府公务员、律师、教师、医务工作者，也有民营企业主等各领域杰出人物，大家各尽所长，组成了一个3000余人的爱心大家庭。大家以扶老、助残、济困为己任，为社会提供关爱服务，奉献爱心、传递正能量。“如意手拉手”、“如意公益环保行”、“如意微心愿”是“如意慈善”品牌服务项目，“如意慈善”组建以来，先后组织爱心人士开展实施各类慈善公益活动数千起：为丹阳重病重症户募捐、对因意外致困/因残致贫家庭进行帮扶、对困难学生助学、为贫困重症老人提供临终关怀、在水晶山、圌山、九曲河等区域开展环保活动、慰问抗日战争朝鲜战争及越南战争老兵，每年坚持来到社会福利院、各乡镇敬老院慰问等等，还组建了海会寺义工队，与海会寺一并弘扬大善大爱，现在如意慈善拥有18个乡镇区域分队及5个特别帮扶小分队(邵苏阳帮护小分队、献血小分队、困境儿童帮护小分队、巾帼志愿者小分队、救援培训分队），3000余名如意慈善爱心人士遍布丹阳城乡，能对困境中的人们提供触手可及的全方位贴心帮扶服务。', '/uploads/20190911/e23d05393246a6b49f4c5a6d2152aefa.jpg', '', '18', '0', '1543043702', '', '', '1', null, '0', '0', '');
INSERT INTO `cst_volunteer_group` VALUES ('29', '0', '丹阳市玉汝于成助学社', '', '', null, '丹阳市玉汝于成助学社于2014年5月经市民政局注册的纯民间的公益助学机构。现有从业人员3人，兼职工作人员17人，注册志愿者156人，爱心人士300余人。\r\n   自成立以来，玉汝于成助学社以网络为载体，利用微信公众号、微信群、朋友圈、QQ群、翼网玉汝于成板块为平台，以“我助学我快乐”为宗旨，以“公平正义透明”为原则，以“结对资助贫困学子”为形式，以“经济和精神”双资助为内容，对丹阳本地和常年居住丹阳的外来务工子女，极度贫困且品学兼优的大中小学生进行资助。截至2018年8月，已结对资助333位。募集社会资金300万并发放，发放各类图书100000余元，发放各类衣服三千余件。针对贫困学子存在的各类问题，以精神引导为己任，连续开展了《东南大学，我来了》《走进苏大，畅想未来》《我要上同济大学》励志夏令营，多次开展心理疏导、国学礼仪培训、公众表达力训练、交通安全教育演讲比赛等活动，坚持连年开展中秋节、春节慰问活动，对缺爹少娘的孤儿和单亲子女进行“爱心爸爸爱心妈妈在行动”活动。直接受益贫困学子300多人，间接受益达1000多人。人数多、活动项目多，不论是炎热难耐的酷暑，还是冰封雪地的严冬，这是对玉汝于成助学社志愿者的磨练。通过活动，锻炼出了一支组织纪律性强、能征善战的志愿者队伍。在丹阳大地引起极大反响。\r\n\r\n   招募联系方式：\r\n\r\n玉汝于成助学社资助的学生多，活动接地气，有着大量的工作要做，需要更多的 \r\n   志愿者的参于与支持。志愿者报名联系电话13615283298，或加微信。玉汝于成助学社办公地址:丹阳市开发区齐梁路77号(大泊社区内北幢二楼)，欢迎大家来！', '/uploads/20190911/e23d05393246a6b49f4c5a6d2152aefa.jpg', '', '18', '0', '1543043838', '', '', '1', null, '0', '0', '');
